(1106, 32, 24, 1, '', '', '<p><span xss=removed>Jika teman anda tersengat listrik pada saat melakukan suatu pekerjaan, tahapan pertolongan pertama dan penangan darurat yang dapat dilakukan untuk meminimalisir resiko bahaya pada korban antara lain sebagai berikut : </span></p><p><span xss=removed>1. </span><span xss=removed>Periksa kondisi korban jika tak bernapas, berikan pernafasan buatan</span><span xss=removed> </span></p><p><span xss=removed>2. Matikan sumber listrik jika mungkin</span></p><p><span xss=removed>3. Bawa korban ke perawatan medis terdekat </span></p><p><span xss=removed>4. Jangan menyentuh korban sampai terbebas dari sengatan listrik</span></p><p><span xss=removed>Tahapan yang benar sesuai standar prosedur adalah….</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1, 2, 3, 4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1, 3, 2, 4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>2, 1, 3, 4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>2, 1, 4, 3</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>3, 1, 2, 4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1645542249, 1645542249),
