(1108, 32, 24, 1, '', '', '<p><span xss=removed>Jika ditempat kerja  terjadi kebakaran kecil/ringan dikarenakan oleh bahan padat non logam seperti kertas, plastik, kain karet, dll, alat pemadam yang modern seperti APAR Air/Water harus tersedia. Prosedur operasional APAR dikenal dengan sebutan </span><span xss=removed>T.A.T.A.</span></p><p xss=removed><span xss=removed>1. Tarik pin pengaman (safety pin) APAR</span></p><p xss=removed><span xss=removed>2. Tekan pemicu untuk menyemprotkan</span></p><p xss=removed><span xss=removed>3. Arahkan nozzle atau pangkal selang ke sumber api (area kebakaran)</span></p><p xss=removed><span xss=removed>4. Ayunkan ke seluruh sumber api (area kebakaran)</span></p><p><span xss=removed>Urutan Langkah penggunaan APAR sesuai prosedur operasional yang benar adalah….</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1, 2, 3, 4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1, 3, 2, 4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>2, 3, 1, 4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>2, 3, 4, 1</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>3, 2, 1, 4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1645542624, 1645542624),
