(1116, 32, 24, 1, '', '', '<p xss=removed><span xss=removed>Kompetensi personal merupakan kemampuan sesorang untuk menghasilkan kinerja (prestasi kerja). Cara mengelola kompetensi personal yaitu dengan menjaga kepribadian, presentasi diri, pelatihan dan pengembangan karir. Contoh dari menjaga kepribadian adalah … .</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Menerapkan aturan cara berpakaian yang baik</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Memberikan promosi kepada karyawan berprestasi</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Mengikutkan karyawan untuk magang di perusahaan lain</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Mendahulukan sikap jujur dalam perkataan dan perbuatan</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Memasang peraturan perusahaan di tempat yang strategis</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1645544249, 1645544249),
(1117, 32, 24, 1, '', '', '<p xss=removed><span xss=removed>Jika teman anda mengalami kecelakaan kerja, pertolongan pertama yang dapat anda lakukan antara lain sebagai berikut: </span></p><ol><li><span xss=removed>Jangan panik</span></li><li><span xss=removed>Jauhkan korban dari kecelakaan berikutnya</span></li><li><span xss=removed>Perhatikan pernafasan, detak jantung, pendarahan, dan tanda-tanda syok</span></li><li><span xss=removed>Jangan memindahkan korban secara tergesa-gesa</span></li><li><span xss=removed>Segera merujuk ke pusat medis terdekat</span></li></ol><p><span xss=removed>Tahapan yang benar sesuai standar prosedur adalah….</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1-2-3-4-5</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>2-1-4-3-5</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>3-2-4-1-5</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>4-1-3-2-5</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>5-4-2-3-1</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1645544363, 1645544363);
