(1118, 32, 24, 1, '', '', '<p xss=removed><span xss=removed>Partisipasi karyawan yang dapat dilakukan dalam hal pengaturan manajemen kesehatan dan keselamatan kerja adalah sebagai berikut: </span></p><ol xss=removed><li><span xss=removed>Mengadakan rapat secara rutin untuk memberikan masukan kepada manager representatif K3</span></li><li><span xss=removed>Mengumpulkan donasi untuk karyawan yang mengalami kecelakaan kerja</span></li><li><span xss=removed>Menyampaikan pendapat secara tertulis melalui kotak saran mengenai kekurangan dalam manajemen K3</span></li><li><span xss=removed>Ikut demo karyawan agar aspirasinya didengar oleh manajemen</span><span xss=removed><br></span><span xss=removed>Partisipasi karyawan yang kurang tepat ditunjukkan nomor….</span></li></ol><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1 dan 2</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1 dan 3</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>2 dan 3</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>2 dan 4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>3 dan 4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1645544519, 1645544519),
(1119, 32, 24, 1, '', '', '<p><span xss=removed>Kamu bekerja di perusahaan yang menempati sebuah gedung di lantai lima. Jika ditempat kerja  terjadi kebakaran, langkah-langkah yang harus dilakukan antara lain :</span></p><p xss=removed><span xss=removed>1. Dengarkan instruksi</span></p><p xss=removed><span xss=removed>2. Hindari lift</span></p><p xss=removed><span xss=removed>3. Pecahkan kaca segera lompat</span></p><p xss=removed><span xss=removed>4. Lindungi saluran pernafasan</span></p><p xss=removed><span xss=removed>5. Gunakan tangga darurat</span></p><p><span xss=removed>Dari langkah tersebut yang tidak boleh kamu lakukan adalah no….</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>2</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>3</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>4</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>5</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'C', 1645544604, 1645544604),
(1120, 33, 25, 1, '', '', '<p xss=removed><span xss=removed>Apar dikenal sebagai alat pemadam api <em>portable</em> yang mudah dibawa, cepat dan tepat di dalam penggunaan untuk awal kebakaran. Dikarenakan fungsinya untuk penanganan dini, peletakan APAR-pun harus ditempatkan di tempat-tempat tertentu dan mudah terlihat sehingga memudahkan didalam penggunaannya</span><span xss=removed>.</span></p><p xss=removed><span xss=removed>Pemasangan dan penempatan APAR yang benar adalah....</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Pemasangan APAR dengan ketinggian max. 1,2 mtr</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Setiap APAR harus dipasang menggantung diluar ruangan</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Pemasangan APAR harus sesuai dengan jumlah benda / tempat yang dilindungi</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Pemasangan APAR <strong>boleh</strong> diruangan yang mempunyai suhu lebih dari 80º C dan di bawah 4º C</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Setiap APAR dipasang pada posisi yang mudah dilihat dan dijangkau dan boleh terhalangi benda apa pun.</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1646056071, 1646285875),
(1121, 33, 25, 1, '', '', '<p xss=removed><span xss=removed>Identifikasi bahaya adalah upaya untuk mengetahui, mengenal, dan memperkirakan adanya bahaya pada suatu sistem, seperti peralatan, tempat kerja, proses kerja, prosedur, dll.</span><span xss=removed> </span></p><p xss=removed><br></p><p xss=removed><span xss=removed>Air Minum, Toilet dan fasilitas mencuci, Ruang makan atau kantin, P3K di tempat kerja dan Transportasi </span><span xss=removed>merupakan kategori....</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Potensi bahaya yang menimbulkan risiko biologis</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Risiko terhadap kesejahteraan atau kesehatan sehari-hari</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Potensi bahaya yang menimbulkan risiko pribadi dan psikologis</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Potensi bahaya yang menimbulkan risiko jangka panjang pada kesehatan</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Potensi bahaya yang menimbulkan risiko langsung pada keselamatan</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1646056598, 1646056934),
(1122, 33, 25, 1, '', '', '<p xss=removed><span xss=removed>Tanggap darurat bencana adalah serangkaian kegiatan yang dilakukan dengan segera pada saat kejadian bencana untuk menangani dampak buruk yang ditimbulkan, yang meliputi kegiatan penyelamatan dan evakuasi korban, harta benda</span><span xss=removed> dll. </span></p><p xss=removed><span xss=removed>Urutan prosedur Evakuasi Keadaan Darurat saat terjadi Kebakaran yang benar sesuai pernyatan dibawah ini adalah....</span></p><p xss=removed><span xss=removed>1.Tetap tenang dan jangan panik</span></p><p xss=removed><span xss=removed>2.Segera lari menuju titik api untuk memadamkannya</span></p><p xss=removed><span xss=removed>3 Segera menuju tangga darurat yang terdekat dengan berjalan biasa dengan cepat namun tidak berlari.</span></p><p xss=removed><span xss=removed>4.Janganlah membawa barang yang lebih besar dari tas kantor/tas tangan</span></p><p xss=removed><span xss=removed>5.Lepaskan sepatu hak tinggi karena menyulitkan dalam langkah kaki</span></p><p xss=removed><span xss=removed>6. Segera menuju tangga ruang aman yang terdekat dengan berlari</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1, 2, 4, 5</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1, 2, 4, 5</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>1, 5, 4, 3</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>3, 4, 5, 6</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala