(1133, 34, 26, 1, '', '', '<p xss=removed><span xss=removed>Ketika seorang mekanik mobil akan melakukan pengukuran komponen mesin mobil menggunakan alat ukur mikrometer dalam, maka dia akan melakukan kalibrasi dimana mikrometer tersebut di perlakuakn sebagai berikut maka pernyataan yang benar adalah </span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Mikrometer dalam sebelum digunakan periksa semua komponen dalam kondisi baik bersihkan dengan kain lap, lakukan kalibrasi dengan memasang di penjepit mikrometer dan putar recet stoper sampai bunyi dan lihat angka di skala utama dan skala vernier apakah angka 0 nya diposisi yang benar</span><span xss=removed>.</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Sebelumnya mikrometer di beri pelumas lalu di bersihkan setelah itu di kalibrasi dengan memutar anvil sampai posisi angka 0 di skala vernier dan sekala utama di posisi yang benar dan tepat</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Mikrometer yang akan digunakan di jepit di ragum lalu di beri pelumas dan selanjutnya di kalibrasi dengan menggunakan alatnya dan perhatikan angka 0 di vernier dan di utama harus posisi yang benar dan tepat baru bersihkan dengan kain lap</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Mikrometer yang akan digunakan harus dalam kondisi terjepit di ragum dan bersihkan dengan detrjen dan keringkan baru kalibrasi dengan kertas dan lakukanseting 0 perhatikan sekala utama dan verniernya harus di posisi tepat dan benar</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Mikrometer di bersihkan dengan cairan pembersih dan keringkan dan di lap dengan kain kering lakukan kalibrasi setelah dijepi di ragum kalibrasi di seting 0 dan lakukan dengan benar dan tepat</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1646288432, 1646288432),
