(1137, 34, 26, 1, '', '', '<p xss=removed><span xss=removed>Di sebuah bengkel mobil terjadi kebakaran di Gudang oli bekas maka untuk memadamkan api tersebut digunakan jenis APAR yaitu</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Air</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Dry chemical powder extinguisher</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Busa AFFF</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Karbon dioksida</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Karung basah</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'C', 1646289276, 1646289276),
(1138, 34, 26, 1, '', '', '<p xss=removed><span xss=removed>Perhatikan gambar jika no 1, 2, 3 tersebut maka apa yang akan terjadi disebuah bengkel dengan kondisi seperti ini, sehingga dapat menduga bahaya yang akan terjadi</span></p><p xss=removed><img src=\"blob:https://meniti.id/367c9249-136d-4533-987d-5455e7de4ab9\" xss=removed class=\"fr-fic fr-dib\"></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Menurunkan barang tidak dari atas dulu, tidak menggunakan APD, memegang tangga dengan satu tangan</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Menurunkan barang kuda kuda salah, bajunya terlalau sexi, memegang tangga dengan satu tangan</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Menurunkan barang tidak dari atas dulu, tidak menggunakan APD, memegang tangga dengan bergaya</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Menurunkan barang tidak dari atas dulu, tidak menggunakan APD, memegang tangga dengan satu tangga</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Semuanya tidak benar</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1646289396, 1646289396),
