(1140, 30, 27, 1, '', '', '<p> (1) Pada 16 November 2010, angklung diakui sebagai Warisan Budaya Dunia Kategori Tak Benda oleh UNESCO. (2) Namun, pelestarian angklung di Indonesia tentu menghadapi hambatan. (3) Perkara klasik seperti tidak adanya regenerasi, baik dari sisi seniman maupun perajin angklung, masih menjadi masalah utama. (4) Bahkan, setelah lebih dari 10 tahun ditetapkan sebagai warisan budaya dunia, angklung tak banyak memiliki peminat dalam tataran generasi muda.</p><p>    (5) Padahal, perkembangan angklung di mancanegara justru menunjukkan kecenderungan positif. (6) Angklung sedikitnya dimainkan di 131 negara, baik di sekolah maupun komunitas. (7) Sebagai contoh, di Amerika Serikat, alat musik Sunda itu dimainkan di universitas-universitas di Pennsylvania dan Hawaii. (8) Melihat hal itu, ada paradoks yang nyata: angklung diminati di negara lain, tetapi ditinggalkan di negara asalnya. (9) Oleh karena itu, regenerasi pemain angklung di Indonesia saat ini perlu menjadi perhatian dari semua pihak. (10) Pembuatan program pelestarian angklung juga menjadi hal yang penting. (11) Angklung mungkin harus dimasukkan ke dalam kurikulum sekolah dari jenjang dasar untuk menjaga kelestariannya.</p><p><br></p><p><br></p><p>Apa gagasan utama paragraf pertama? </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Ada berbagai hambatan dalam pelestarian angklung di Indonesia.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Angklung ditetapkan sebagai warisan budaya dunia oleh UNESCO.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Angklung merupakan warisan budaya UNESCO yang sepi peminat. </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Angklung sulit dilestarikan meskipun sudah jadi warisan budaya dunia</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Angklung ditetapkan sebagai warisan budaya dunia meskipun tak banyak diminati.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676256567, 1676256567),
(1141, 30, 27, 1, '', '', '<p>Orang yang menderita penyakit katarak memiliki risiko mengalami penglihatan menjadi kabur. Upaya mengurangi penyakit katarak dapat dilakukan dengan mengkonsumsi makanan yang mengandung antioksidan. Risiko penglihatan menjadi kabur berkurang ketika penyakit katarak dapat dicegah.</p><p><br></p><p>Berdasarkan informasi tersebut,manakah pernyataan berikut yang PASTI BENAR?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Resiko penglihatan menjadi kabur berkurang jika mengonsumsi makanan yang mengandung antioksidan.</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Mengonsumsi makanan yang mengandung antioksidan merupakan cara yang paling efektif untuk mencegah penglihatan menjadi kabur.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Orang yang memiliki penglihatan kabur akan sembuh dengan mengkonsumsi makanan yang mengandung antioksidan</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<ul><li><span xss=removed>Orang yang mengalami penyakit katarak tidak mengonsumsi makanan yang mengandung antioksidan</span></li></ul><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><br></p><p> Orang yang mengalami penyakit katarak tidak mengonsumsi makanan yang mengandung antioksidan</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676262660, 1676262660),
(1142, 30, 27, 2, '', '', '<p>Seorang pakar tanaman hutan kota mengatakan bahwa pepohonan sangat efektif dalam menyerap polutan yang menyebabkan polusi udara. Salah satu pohon penyerap polutan adalah pohon trembesi karena berbentuk besar dan memiliki kemampuan yang tinggi dalam menyerap karbon dioksida <span xss=removed>(</span><span xss=removed>C</span><span xss=removed>O</span><span xss=removed>2</span><span xss=removed>)</span><span xss=removed>.</span></p><p><br></p><p><br></p><p>Berdasarkan informasi tersebut, manakah pernyataan berikut yang PASTI BENAR?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Polusi udara akan menurun jika banyak pohon trembesi ditanam.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pohon trembesi yang berukuran kecil tidak mampu meyerap banyak </p><p>C<span xss=removed>O</span><span xss=removed>2</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Udara akan menjadi lebih panas jika tidak ada pohon trembesi.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Terdapat pohon selain trembesi yang mampu menyerap lebih banyak <span xss=removed>C</span><span xss=removed>O</span><span xss=removed>2.</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Semua pohon yang efektif dalam menyerap polutan memiliki ukuran yang besar.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676262986, 1676262986),
(1143, 30, 27, 1, '', '', '<p>Berjemur di pagi hari memberikan banyak manfaat bagi kesehataan, antara lain meredakan gejala alergi dan infeksi saluran pernapasan, serta membantu pemenuhan kebutuhan vitamin D bagi tubuh. Vitamin D berguna dalam menghindarkan tubuh dari resiko penyakit tulang. Namun demikian, paparan sinar matahari yang berlebihan juga berpotensi menyebabkan penyakit kanker kulit.</p><p><br></p><p>Berdasarkan informasi tersebut, manakah pernyataan beikut yang PASTI BENAR?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Tidak ada dampak negatif dari berjemur di bawah sinar matahari pagi.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Berjemur dibawah sinar matahari lebih bermanfaat pada orang tua daripada anak-anak.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Selain berjemur, kebutuhan vitamin D dapat dipenuhi dari makanan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Untuk mendapatkan manfaat optimal dari berjemur, kita perlu memilih waktu berjemur yang tepat.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Berjemur di siang hari dengan paparan sinar matahari yang menyengat dapat menyebabkan kanker kulit.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676263421, 1676263421),
(1144, 30, 27, 1, '', '', '<p>Perhatikan pernyataan berikut!</p><p><br></p><p>Kakak sedang belajar dan adik sedang bermain boneka.</p><p><br></p><p>Ingkaran yang tepat untuk pernyataan tersebut adalah …</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><span xss=removed>Kakak sedang tidak belajar atau adik sedang bermain boneka.</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kakak tidak sedang belajar dan adik juga tidak sedang bermain boneka.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kakak sedang belajar dan adik sedang tidak bermain boneka.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kakak sedang belajar atau adik tidak sedang bermain boneka.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kakak sedang tidak belajar atau adik tidak sedang bermain boneka.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676263491, 1676263491);
