(1145, 30, 27, 1, '', '', '<p>Perhatikan pernyataan-pernyataan berikut!</p><p><br></p><p>Jika Radit belajar dengan serius, maka ia akan memperoleh nilai UTBK yang tinggi. Jika nilai UTBK Radit tinggi, maka Ayah memberikan hadiah motor dan laptop baru. Ternyata, Ayah hanya memberikan hadiah laptop baru kepada Radit.</p><p><br></p><p>Simpulan yang paling tepat dari pernyataan-pernyataan tersebut adalah ....</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Ayah akan memberikan hadiah laptop jika Radit belajar dengan serius atau memperoleh nilai UTBK yang tinggi.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Radit tidak belajar dengan serius, tetapi memperoleh nilai UTBK yang tinggi.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Ayah memberikan hadiah laptop karena Radit sudah belajar dengan serius.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Radit belajar dengan serius, tetapi tidak memperoleh nilai UTBK yang tinggi.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Radit tidak belajar dengan serius.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676263713, 1676263713),
(1146, 30, 27, 1, '', '', '<p>Hewan langka terancam punah ketika terjadi penebangan hutan dan perburuan binatang secara liar di hutan. Di hutan X sering terjadi penebangan hutan dan perburuan gajah secara liar.</p><p>Simpulan berdasarkan informasi dalam teks tersebut adalah gajah di hutan terancam punah.</p><p><br></p><p>Manakah pernyataan berikut yang menggambarkan kualitas simpulan tersebut?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Simpulan tersebut pasti benar.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Simpulan tersebut pasti salah.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Simpulan tersebut mungkin benar.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Simpulan tidak dapat dinilai karena informasi tidak cukup.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Simpulan tidak relevan dengan informasi yang diberikan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'C', 1676263826, 1676263826),
(1147, 30, 27, 1, '', '', '<p>Banyak orang menyukai makanan pedas karena makanan pedas terasa lebih nikmat dan menggugah selera. Namun, terlalu banyak mengonsumsi makanan pedas dapat mengakibatkan gangguan lambung dan iritasi usus. Makanan pedas dapat memicu naiknya asam lambung dan mengakibatkan tenggorokan menjadi panas. Orang disarankan untuk membatasi konsumsi makanan pedas agar terhindar dari gangguan pencernaan.</p><p><br></p><p>Berdasarkan informasi tersebut, manakah pernyataan berikut ini yang PASTI SALAH?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Makanan pedas terasa lebih nikmat sehingga mendorong orang makan lebih banyak.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Tenggorokan panas terjadi karena asam lambung naik akibat mengonsumsi makanan pedas.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Orang yang mengonsumsi makanan pedas berpotensi mengalami gangguan iritasi usus.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Makanan pedas dapat memicu gangguan pencernaan sehingga tidak menggugah selera.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Mengonsumsi makanan pedas secara tidak berlebihan aman bagi kesehatan pencernaan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676264010, 1676264010),
(1148, 30, 27, 1, '', '', '<p>Kebiasaan membuang sampah di sungai menyebabkan banyak penumpukan sampah di dasar sungai. Penumpukan sampah di dasar sungai menyebabkan sungai menjadi dangkal. Meskipun sungai merupakan salah satu prasarana transportasi yang penting, transportasi air tidak dapat melalui sungai yang mengalami pendangkalan. Berdasarkan informasi di atas, manakah pernyataan di bawah ini yang BENAR?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Sungai yang menjadi prasarana transportasi menyebabkan banyak sampah dibuang ke sungai.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kebiasaan membuang sampah di sungai menyebabkan prasarana transportasi sungai terganggu.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Sungai yang tidak bisa dilewati alat transportasi air menyebabkan sungai tersebut menjadi tempat pembuangan sampah.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Sungai yang dangkal menyebabkan penumpukan sampah di sepanjang aliran sungai.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Adanya sungai sebagai prasarana transportasi menyebabkan banyak aktivitas dilakukan di sepanjang aliran sungai.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676264146, 1676264146),
(1149, 30, 27, 1, '', '', '<p>Perhatikan teks berikut!</p><p><br></p><p>Kementerian Perdagangan menargetkan harga minyak goreng sawit sesuai dengan aturan harga eceran tertinggi baru. Namun, minimnya pasokan minyak goreng di pasar membuat target gagal tercapai.</p><p><br></p><p>Andi, M. A. (2022). Pasokan Terbatas, Harga Minyak Goreng Curah Masih Rp 20 Ribu.</p><p><br></p><p> </p><p><br></p><p>Berdasarkan teks tersebut, jika harga minyak goreng sawit sesuai dengan harga eceran tertinggi baru, simpulan yang PALING TEPAT adalah...</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pasokan minyak goreng di pasar tidak dapat memenuhi kebutuhan pasar.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pasokan minyak goreng di pasar melebihi kebutuhan pasar.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Target Kementerian Perdagangan belum tercapai.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Tidak ada pasokan minyak goreng di pasar.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Target Kementerian Perdagangan tidak tercapai.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676264185, 1676264185),
(1150, 30, 27, 1, '', '', '<p>Pada tahun 2012, banyak masyarakat di Negara X yang tidak mau menggunakan media sosial. Pada tahun 2014, pengguna media sosial di Negara X bertambah dua kali lipat dibandingkan pada tahun 2012.</p><p><br></p><p>Manakah pernyataan berikut yang PALING MUNGKIN menjelaskan perbedaan kedua kondisi tersebut?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pada tahun 2012, bermunculan berbagai macam platform media sosial.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pada tahun 2012, penyedia jasa layanan internet memberikan promosi untuk mengakses media sosial.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pada tahun 2014, media sosial banyak digunakan untuk menyebarkan berita bohong</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pada tahun 2014, media sosial digunakan oleh masyarakat dari golongan usia tertentu.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pada tahun 2014, banyak masyarakat yang merasakan manfaat positif dari media sosial.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676264283, 1676264283),
(1151, 30, 27, 1, '', '', '<p>Perhatikan pernyataan berikut!</p><p><br></p><p>Ridho sedang berlibur di sebuah negara bernama Ellesmere. Di sana, ia mengunjungi beberapa kota. Dari hotel tempat tinggalnya, Kota Domina lebih jauh daripada Kota Tirianna. Kota Ebraxas lebih dekat daripada Kota Tirianna. Kota Fiandara lebih jauh daripada Seren. Kota Tirianna lebih jauh daripada Kota Fiandara. Kota Ebraxas lebih dekat daripada Kota Seren.</p><p><br></p><p>Berdasarkan penjelasan tersebut, kota terjauh ketiga adalah ....</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Tirianna</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Seren</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Fiandara</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Ebraxas</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Domina</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'C', 1676264303, 1676264303),
(1152, 30, 27, 1, '', '', '<p>Jimin, Jungkook, Taehyung, Yoongi, dan Seokjin sedang mengikuti sebuah tes dan memperoleh hasil sebagai berikut.</p><p><br></p><p>Nilai Taehyung lebih tinggi daripada nilai Jimin dan sama dengan dua kali nilai Jungkook.</p><p>Jika nilai Jimin dan Jungkook ditambahkan, hasilnya sama dengan nilai Yoongi.</p><p>Nilai Jimin lebih besar daripada nilai Seokjin, namun hanya sepertiga nilai Yoongi.</p><p>Urutan siswa yang memiliki nilai tertinggi hingga terendah adalah ....</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Jungkook, Taehyung, Yoongi, Jimin, Seokjin</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Yoongi, Jungkook, Taehyung, Jimin, Seokjin</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Yoongi, Taehyung, Jungkook, Jimin, Seokjin</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Taehyung, Yoongi, Jimin, Jungkook, Seokjin</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Taehyung, Yoongi, Jungkook, Jimin, Seokjin</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676264464, 1676264464),
