(1166, 30, 27, 1, '', '', '<p>Jumlah pengunjung kebun binatang A selama lima hari berturut-turut adalah 40 , 43 , 42 , 45 , dan 44 orang. Sementara itu, jumlah pengunjung kebun binatang B dalam lima hari yang sama adalah 13 , 14 , 17 , 22 , dan 29 orang. Jika tren jumlah pengunjung tersebut bersifat konstan, berapa orang pengunjung kebun binatang A dan B pada hari keenam?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>43 dan 38 orang</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>47 dan 35 orang</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>43 dan 39 orang</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>47 dan 38 orang</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>47 dan 39 orang</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676267239, 1676267239),
(1167, 30, 27, 1, '', '', '<p>Rata-rata kecepatan dari tiga pesepeda A , B , dan C adalah 70 km/jam . Rata-rata kecepatan dari pesepeda A dan B adalah 75 km/jam . Jika kecepatan pesepeda B kurang dari 70 km/jam , manakah pernyataan yang PALING TEPAT menggambarkan kecepatan dari ketiga pesepeda tersebut?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pesepeda A adalah yang paling lambat</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pesepeda B adalah yang paling lambat</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pesepeda B adalah yang paling cepat.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pesepeda </p><p>C</p><p> adalah yang paling cepat.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pesepeda </p><p>A</p><p> adalah yang paling cepat</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676267444, 1676267444),
(1168, 30, 27, 1, '', '', '<p>Kontraktor akan melakukan pembangunan sebuah gedung dengan mempertimbangkan beberapa kondisi berikut. Jika pencairan anggaran berjalan lancar, waktu penyelesaian pekerjaan lebih cepat 15 % . Jika peralatan tersedia lengkap, pekerjaan dapat diselesaikan lebih cepat 1 10 kali. Jika menggunakan pekerja yang berpengalaman, penyelesaian pekerjaan lebih cepat 1 4 kali. Jika izin mendirikan bangunan terhambat, waktu penyelesaian pekerjaan bertambah 5 % . Manakah kondisi yang perlu dipertimbangkan agar dapat PALING CEPAT menyelesaikan pekerjaan?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pencairan anggaran dan ketersediaan peralatan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Ketersediaan peralatan dan pengalaman pekerja.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pencairan anggaran dan pengalaman pekerja.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengalaman pekerja dan perizinan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Ketersediaan peralatan dan perizinan</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'C', 1676267658, 1676267658),
(1169, 30, 27, 1, '', '', '<p>A mendapatkan gaji tetap Rp 6.000.000 , 00 per bulan dengan bonus berkisar Rp 500.000 , 00 − Rp 1.000.000 , 00 . Gaji yang didapatkan B adalah sebesar Rp 1.750.000 , 00 per minggu. Sebagai penjual kopi, C menjual 20 − 30 gelas kopi per hari dengan harga satuan Rp 10.000 , 00 . Jika satu bulan dihitung 28 hari, manakah pernyataan yang PALING TEPAT?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pendapatan C dapat yang paling rendah</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pendapatan A dapat yang paling tinggi</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pendapatan <span xss=removed>C l</span><span xss=removed>ebih tinggi daripada </span><span xss=removed>A</span><span xss=removed>.</span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>( C ) Pendapatan B lebih tinggi daripada A .</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pendapatan C lebih rendah daripada B .</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676267939, 1676267939),
