(1174, 30, 27, 1, '', '', '<p>Teks ini digunakan untuk menjawab soal nomor 11 dan 12.</p><p><br></p><p>    (1) Sebagian besar masyarakat, dari mana pun asalnya, mungkin sudah akrab dengan putri duyung. (2) Makhluk yang digambarkan sebagai makhluk air yang memesona serta berbentuk setengah manusia dan setengah ikan hibrida itu sering muncul dalam dongeng. (3) Namun, tidak banyak yang mengetahui asal-usul makhluk itu meski ia telah hidup dalam berbagai dongeng dan legenda selama ribuan tahun. (4) Belakangan, ada pendapat yang mengeklaim bahwa gagasan tentang putri duyung mungkin berasal dari sebuah gangguan medis yang dinamakan sirenomelia. (5) Sirenomelia dikenal juga sebagai sindrom putri duyung, yakni malformasi kongenital langka dan fatal yang ditandai dengan adanya fusi pada tungkai bawah. (6) Kondisi ini menghasilkan sesuatu yang menyerupai ekor ikan.</p><p><br></p><p>    (7) Beberapa orang mempertanyakan keterkaitan antara kasus dari kondisi tersebut dengan legenda putri duyung yang sudah muncul sejak dahulu kala. (8) Pasalnya, deskripsi kuno monster laut juga berasal dari penampakan spesies yang meski semula tidak dikenali, kini telah teridentifikasi sebagai paus, cumi-cumi raksasa, dan walrus. (9) Namun, hingga saat ini, pengaruh kondisi bawaan terhadap asal-usul mitologi putri duyung belum diketahui secara pasti. (10) Meski begitu, adanya dongeng putri duyung telah membantu anak-anak yang menderita sirenomelia. (11) Setidaknya, mereka biasanya bisa merasa bangga karena mirip dengan makhluk cantik yang sering muncul dalam dongeng (putri duyung).</p><p>Tujuan penulisan kalimat (3) pada bacaan tersebut adalah ....</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>menunjukkan sikap penulis yang menyayangkan suatu hal terkait putri duyung</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>menguatkan gagasan tentang putri duyung yang dibahas pada kalimat sebelumnya</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>memerinci pembahasan tentang makhluk air yang berbentuk setengah manusia</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>menambahkan penjelasan mengenai bentuk serta asal-usul putri duyung</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>menjelaskan secara detail asal-usul putri duyung yang belum banyak diketahui</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676269837, 1676269837),
