(1176, 30, 27, 1, '', '', '<p>Perhatikan teks berikut!</p><p><br></p><p>Kebanyakan orang lebih suka begadang karena efek dari pola hidup yang ikut berubah lantaran diharuskan bekerja atau belajar bagi mahasiswa. Berdasarkan penelitian, mereka yang tidur lebih lambat memiliki tingkat kortisol yang lebih rendah di pagi hari. Hal ini membuat orang yang tidur larut malam memiliki tingkat stres yang rendah.</p><p>Manakah pernyataan berikut yang akan MEMPERLEMAH hasil penelitian tersebut?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Begadang sering dilakukan mahasiswa untuk belajar.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Banyak orang mengalami stres karena bekerja sampai larut malam.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Begadang membuat kondisi badan lebih bugar pada pagi hari.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Sebagian orang memiliki pola tidur lebih lambat karena mengalami stres.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Orang merasa stres karena meningkatnya kortisol yang disebabkan oleh begadang.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676270141, 1676270141),
(1177, 30, 27, 1, '', '', '<p>Perhatikan beberapa pernyataan berikut!</p><p><br></p><p>Peneliti A menyatakan, \"Mengembalikan mood dan mengurangi stres dapat diatasi dengan makan\".</p><p><br></p><p>Peneliti B menyatakan, \"Kandungan serotonin dan antidepresan yang ada pada cokelat dapat meningkatkan mood seseorang\". </p><p><br></p><p>Hasil penelitian terbaru mengatakan bahwa orang yang mengonsumsi cokelat hitam dalam dua kali 24 jam, lebih kecil kemungkinannya untuk melaporkan gejala depresi yang relevan secara klinis dibandingkan mereka yang tidak makan cokelat sama sekali. Dalam bahasa non-riset, makan cokelat hitam bisa membuat seseorang merasa lebih bahagia.</p><p>Manakah pernyataan berikut yang PALING TEPAT mengenai hasil penelitian terbaru tersebut?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Tidak relevan dengan pernyataan peneliti A dan memperkuat pernyataan peneliti B.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Relevan dengan pernyataan peneliti A dan memperkuat pernyataan peneliti B. </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Memperkuat pernyataan peneliti A dan memperlemah pernyataan peneliti B.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Memperlemah pernyataan peneliti A dan memperkuat pernyataan peneliti B.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Memperkuat pernyataan peneliti A dan peneliti B.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676270222, 1676270222),
(1178, 30, 27, 1, '', '', '<p>Perhatikan penggalan teks berikut!</p><p><br></p><p>Indeks harga yang dibayar petani merupakan biaya input produksi seperti pupuk, transportasi, dan lainnya ditambah dengan biaya konsumsi rumah tangga. Di sisi lain, indeks harga yang diterima berasal dari hasil penjualan produk. Walaupun ada kenaikan, angkanya lebih kecil dari ongkos produksi dan biaya hidup.</p><p><br></p><p>Catatan: nilai tukar petani merupakan perbandingan antara indeks harga yang diterima petani dengan indeks harga yang dibayar petani.</p><p><br></p><p>Berdasarkan teks tersebut, pernyataan di bawah ini yang PASTI SALAH adalah …</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Profesi sebagai petani mengharuskan melakukan pengeluaran untuk pupuk, transportasi, dan biaya perawatan traktor.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Biaya output produksi petani hanya berasal dari penjualan produk hasil pertanian.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Indeks harga yang diterima petani tidak mengalami kenaikan yang signifikan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Biaya input produksi petani lebih kecil daripada biaya output produksi.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengeluaran petani lebih tinggi ketimbang pendapatannya.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676270300, 1676270300),
(1179, 30, 27, 1, '', '', '<p>Perhatikan penggalan teks berikut! </p><p><br></p><p>Gangguan irama jantung atau aritmia adalah kondisi saat jantung 1acap kali berdetak terlalu cepat, lambat, atau tidak beraturan. Aritmia terjadi saat sinyal listrik yang bertugas mengatur koordinasi detak jantung tidak berfungsi dengan baik. Sejumlah kasus gangguan irama jantung tidak berbahaya. Namun, ada juga yang menimbulkan gejala serius dan mengancam keselamatan.</p><p><br></p><p>    Dilansir dari laman 2Mayo Clinic, dalam kondisi normal, jantung manusia berdetak 360 sampai 100 kali permenit. Saat berolahraga atau stres, jantung berdetak lebih cepat atau lebih dari 100 kali permenit. Sementara itu, saat tidur atau relaksasi, jantung berdetak lebih lambat atau kurang dari 60 kali permenit. 4Namun dalam keadaan normal, detak jantung penderita aritmia bisa di luar ambang batas ideal. </p><p><br></p><p>Apakah bagian bernomor (2) perlu diperbaiki? Jika perlu, apa yang paling tepat untuk menggantikan bagian tersebut?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>“Mayo Clinic”</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>TIDAK PERLU DIPERBAIKI</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Mayo Clinic</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>_Mayo Clinic_</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Mayo clinic</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676270493, 1676270493),
(1180, 30, 27, 1, '', '', '<p>Diketahui pada pukul 07.00 terdapat suatu zat dengan massa 20 kg. Laju peluruhan zat tersebut adalah 10% per 30 menit. Berdasarkan informasi tersebut, banyak pernyataan berikut yang bernilai benar adalah ....</p><p><br></p><p>1.Sisa zat pada pukul 08.00 adalah 18 kg.</p><p>2.Sisa zat setelah meluruh selama 0,5 jam adalah 19 kg.</p><p>3.Sisa zat setelah meluruh selama 1,5 jam adalah 15,4 kg.</p><p>4.Sisa zat pada pukul 09.00 adalah 16,122 kg.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>4</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>3</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>2</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>1</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>0</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676270622, 1676270622),
(1181, 30, 27, 1, '', '', '<p>Terdapat empat buah kartu yang masing-masing bertuliskan sebuah angka. Dua kartu di antaranya bertuliskan angka 3 dan 5, sedangkan angka yang tertulis pada dua kartu sisanya tidak diketahui.</p><p><br></p><p>Dari angka-angka pada kartu tersebut akan dibuat bilangan 4 angka. Jika angka yang tertulis pada dua kartu yang belum diketahui adalah angka yang berbeda, maka berapakah banyak bilangan yang mungkin terbentuk?</p><p><br></p><p>Perhatikan pernyataan berikut!</p><p><br></p><p>1.Angka yang tertulis pada dua kartu yang belum diketahui adalah bilangan asli kelipatan 4.</p><p><br></p><p>2.Angka yang tertulis pada kartu pertama lebih besar dari angka yang tertulis pada kartu kedua.</p><p><br></p><p>Apakah pernyataan di atas cukup untuk menjawab pertanyaan pada soal?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pernyataan 1 dan pernyataan 2 tidak cukup untuk menjawab pertanyaan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pernyataan 1 SAJA cukup untuk menjawab pertanyaan dan pernyataan 2 SAJA cukup.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>DUA pernyataan BERSAMA-SAMA cukup untuk menjawab pertanyaan, tetapi SATU pernyataan SAJA tidak cukup.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pernyataan 2 SAJA cukup untuk menjawab pertanyaan, tetapi pernyataan 1 SAJA tidak cukup.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pernyataan 1 SAJA cukup untuk menjawab pertanyaan, tetapi pernyataan 2 SAJA tidak cukup.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676270826, 1676270826),
(1182, 30, 27, 1, '570283f61c8f6d6cec62c5a475d0854a.jpg', 'image/jpeg', '<p>Perhatikan grafik di bawah ini!</p><p>Berdasarkan grafik tersebut, pernyataan berikut ini yang SALAH adalah ...</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Dibanding Maret 2016, jumlah penduduk miskin pada Maret 2017 naik sebanyak 240 ribu orang.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Jumlah penduduk miskin mengalami penurunan dari Maret 2016 sampai dengan September 2019.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Persentase penduduk miskin pada September 2019 mengalami penurunan sebesar 0,19% dibanding Maret 2019 dan 0,44% dibanding September 2018.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Penurunan persentase penduduk miskin dari Maret 2013 ke Maret 2017 lebih besar dari penurunan persentase dari September 2012 ke September 2015.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Jumlah penduduk miskin pada September 2019 mengalami penurunan sebesar 0,35 juta orang dibanding Maret 2019 dan 0,88 juta orang dibanding September 2018.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676270944, 1676270944),
(1183, 30, 27, 1, '', '', '<p>Pada ujian TOEFL, terdapat 45?ri peserta ujian yang dinyatakan lulus. Jika pu 2adari peserta ujian yang lulus tersebut adalah 45 orang, maka banyak peserta ujian yang dinyatakan tidak lulus adalah ... orang.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>225</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>275</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>325</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>375</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>500</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676271175, 1676271175),
(1184, 30, 27, 1, '', '', '<p>The questions number 1–3 are based on the following passage. In the US, consumers spend around $700 million a year keeping their fabrics soft. In the UK people spend £200 million a year on fabric softener. A giant manufacturer even claims a massive 50 percent share of the market. Despite the popularity, fabric softeners can be harmful to both the people who use them and the marine life that ends up swimming in them. Fabric softening surfactants can be derived from animals, plants or minerals, as in the case of newer, silicone-based formulations. There is little difference between the chemicals used in fabric softeners and those used in hair conditioners. Whatever they are based on, all fabric softeners work in pretty much the same way, by depositing these surfactants onto the fabric to make it feel softer, reduce static cling, and impart a fresh fragrance. Special fixatives in the mix of both standard and luxury conditioners mean that the fragrance can last for days, permeating wardrobes and drawers. The regular off-gassing of perfume chemicals from fabric softeners can be a significant trigger for asthma and other breathing problems. In the US, chemically sensitive individuals complain that, even after several washes, they cannot get the smell of fabric softeners out of their washing machines and dryers. If you are a fabric softener addict, there are now a number of companies that provide alternative and ‘green’ fabric softeners. However, essentially, these are unnecessary products that can trigger health problems and can interfere with the functional aspect of some textiles. For instance, when used on towels and nappies, some fabric softeners can reduce absorbency, which is why it’s generally recommended that reusable nappies aren’t washed with them. Once they are washed down the drain they can become highly toxic to aquatic life. Given this, maybe it’s worth asking yourself whether the time has come to break the fabric softener habit completely.</p><p>What does the passage mainly talk about?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Environmental issues caused by fabric softener</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Controlling the habit of using fabric softener</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Harmful compounds found in fabric softener</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The popularity of fabric softener in the US</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The downside of fabric softener usage</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676275973, 1676275973),
(1185, 30, 27, 1, '', '', '<p>The word permeating in the third paragraph is similar in meaning with ….</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>absorbing</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>attaining</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>charging</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>soaking</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>filling</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676276042, 1676276042),
(1186, 30, 27, 1, '', '', '<p>Based on the passage, it can be hypothesized that …</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>People with breathing problems will feel safer using fabric softener if it contains fewer perfume chemicals.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The absorbency in some textiles will be reduced if they are washed with fabric softeners.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A small amount of fabric softener chemicals in the water will not harm aquatic life.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Manufactures will shift to producing &#39;green&#39; fabric softener products.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Green&#39; softeners are developed in response to the needs of fabric softener addicts.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676276120, 1676276120),
(1187, 30, 27, 1, 'a5924c2e37e278a0477b2cc7f1ba3df7.png', 'image/png', '<p><strong>1. Perhatikan ilustrasi berikut untuk menjawab soal nomor 1-3!</strong><strong><br></strong></p><p>Anggun membawa tiga buah barang, yaitu A, B, dan C yang beratnya berturut-turut   1.450 g, 0,5 kg, dan 3,2 kg ke WahAda Cargo untuk dikirimkan ke Cimahi. Berikut ini tabel yang menunjukkan biaya pengiriman barang.</p><p>Jika Anggun ingin berhemat, yang paling menguntungkan bagi Anggun di antara pilihan berikut ini adalah …</p><ol><li>Pengiriman barang A, B, dan C masing-masing terpisah.</li><li>Pengiriman barang A dan B digabung, sedangkan barang C terpisah.</li><li>Pengiriman barang A dan C digabung, sedangkan barang B terpisah.</li><li>Pengiriman barang B dan C digabung, sedangkan barang A terpisah.</li><li>Pengiriman barang A, B, dan C digabung</li></ol><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengiriman barang A dan B digabung, sedangkan barang C terpisah.</p><p>Karena barang A digabung dengan barang B, maka beratnya menjadi 1.450g + 500g = 1.950g. Kemudian total biaya yang dikeluarkan adalah sebagai berikut.</p><p>Total biaya</p><p>= biaya barang A + biaya barang B + biaya barang C</p><p>= 13.250 + 13.250</p><p>= 26.500</p><p>Didapat bahwa biaya pengiriman pada pilihan B adalah Rp26.500,00.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengiriman barang A, B, dan C digabung.</p><p>Karena semua barang digabung, maka beratnya menjadi 1.450g + 500g + 3.200g = 5.150g.  Kemudian, total biaya yang dikeluarkan adalah sebagai berikut.</p><p>Total biaya</p><p>= biaya barang ABC</p><p>= 37.700</p><p>Didapat bahwa biaya pengiriman pada pilihan E adalah Rp37.700,00.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengiriman barang B dan C digabung, sedangkan barang A terpisah.</p><p>Karena barang B digabung dengan barang C, maka beratnya menjadi 500g + 3.200g = 3.700g. Maka, total biaya yang dikeluarkan adalah sebagai berikut.</p><p>Total biaya</p><p>= biaya barang B dan C + biaya barang A</p><p>= 24.500 + 13.250</p><p>= 37.750</p><p>Didapat bahwa biaya pengiriman pada pilihan D adalah Rp37.750,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengiriman barang A dan C digabung, sedangkan barang B terpisah.</p><p>Karena barang A digabung dengan barang C, maka beratnya menjadi 1.450g + 3.200g = 4.650g. Kemudian, total biaya yang dikeluarkan adalah sebagai berikut.</p><p>Total biaya</p><p>= biaya barang A dan C + biaya barang B </p><p>= 24.500 + 6.900</p><p>= 31.400</p><p>Didapat bahwa biaya pengiriman pada pilihan C adalah Rp31.400,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengiriman barang A, B, dan C masing-masing terpisah.</p><p>Karena ketiga barang dikirim terpisah, maka total biaya yang dikeluarkan adalah sebagai berikut.</p><p>Total biaya</p><p>= biaya barang A + biaya barang B + biaya barang C</p><p>= 13.250 + 6.900 + 13.250</p><p>= 33.400</p><p>Didapat bahwa biaya pengiriman pada pilihan A adalah Rp33.400,00.</p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676276173, 1676276173),
(1188, 30, 27, 1, '', '', '<p>2.Diketahui terdapat penambahan biaya pengemasan sebesar Rp3.000,00 untuk setiap pengiriman. Jika Anggun ingin mengirim dua barang sekaligus dan satu barang terpisah, biaya termurah yang dikeluarkan Anggun adalah...</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp20.150,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp32.500,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp44.650,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp43.750,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp37.400,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676276374, 1676276374),
(1189, 30, 27, 1, '', '', '<p>The questions number 4–7 are based on the following passage.</p><p><br></p><p>The United Nations predicts Earth will have to feed another 2.3 billion people by 2050, mostly concentrated in urban centers far from farmland. Conventional agriculture may not be able to meet that demand, but luckily NASA has been working for decades to tackle food production both on Earth and in space. Feeding astronauts during long-term space exploration means stretching resources to grow plants in space—including minimizing water use and energy consumption and eliminating soil.</p><p><br></p><p>NASA initially pioneered these techniques on the ground by building the country’s first vertical farm. Inside a decommissioned hypobaric chamber left over from testing the Mercury space capsule, technologists stacked rows of hydroponic trays like bookshelves against the walls. Then systems for lighting, ventilation, and circulating water were added using off-the-shelf parts. Various crops were planted on the stacked trays to test how well they would grow in water and without the benefit of sunlight or open air. This innovative approach to farming created a foundation for the industry of controlled environment agriculture, or CEA.</p><p><br></p><p>CEA combines plant science and environmental control to optimize plant growth and maximize efficiency, frequently incorporating vertical growth structures. Technology enables the filtering of contaminants from crop water and delivers precise nutrient balances. Artificial lighting provides only the necessary wavelengths at the right time, intensity, and duration, while environmental controls maintain ideal temperature and humidity. This approach could help feed burgeoning future generations, said Nate Storey, chief science officer at Plenty Unlimited, one of several companies building on NASA’s plant-growth research.</p><p>It is stated in the passage that …</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>NASA&#39;s innovative approach pioneered the establishment of a controlled environment agriculture industry.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>To improve plant development, plant science must be integrated with vertical growth structures.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>NASA is taking over conventional agriculture to address future food demands.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>NASA has maximized a farming method requiring a little water.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The world will run out of food by 2050 according to the United Nations.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676276412, 1676276412),
(1190, 30, 27, 1, '', '', '<p>3.Jika terdapat penambahan biaya pengemasan sebesar Rp3.000,00 untuk setiap pengiriman, pilihan berikut yang paling <strong>tidak</strong> menguntungkan bagi Anggun adalah...</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengiriman barang A dan B digabung, sedangkan barang C terpisah.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengiriman barang A dan C digabung, sedangkan barang B terpisah </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengiriman barang B dan C digabung, sedangkan barang A terpisah.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengiriman barang A, B, dan C masing-masing terpisah.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pengiriman barang A, B, dan C digabung.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'C', 1676276639, 1676276639),
(1191, 30, 27, 1, '', '', '<p>Regarding the role of NASA in producing food, we know that …</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The more farming techniques NASA uses, the less energy it requires.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The greater the space exploration is carried out, the more number of astronauts that must be fed.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The more people requiring food, the more maximum NASA&#39;s agricultural technology will be.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The longer the space expedition is, the more NASA optimizes its farming resources.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The more maximum NASA farming technology becomes, the less traditional farming will be required.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676276725, 1676276725),
(1192, 30, 27, 1, '', '', '<p>From the first paragraph, it can be predicted that …</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The United Nations estimates that Earth will have to feed billions of people for a decade.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>NASA will be more concerned with food production in space than with food production on Earth.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Conventional agriculture will succeed in feeding astronauts if it is combined with NASA&#39;s techniques.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>In the future, there will not be enough land for conventional agriculture.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The most crucial aspect of long-term space exploration will be astronaut nutrition.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676276887, 1676276887),
(1193, 30, 27, 1, '', '', '<p>How is the second paragraph related to the first paragraph?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The second paragraph expands on the first paragraph&#39;s discussion of NASA&#39;s agricultural method.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Paragraph 2 exemplifies kinds of agricultural progress discussed in paragraph 1.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The vertical farm described in paragraph 1 is explained in detail in paragraph 2.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The success of the NASA farming practices mentioned in the first paragraph is reiterated in the second paragraph.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The second paragraph explains further the issues raised in the first paragraph regarding food demands in 2050.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676277115, 1676277115),
(1194, 30, 27, 1, '654d680667d4b19fc5ef9bdf16c02b1a.png', 'image/png', '<p><strong>4. Perhatikan informasi berikut untuk menjawab soal nomor 4 dan 5!</strong></p><p>Faktor-faktor yang memengaruhi terjadinya reaksi kimia adalah perubahan energi Gibbs <img src=\"blob:https://cbt.meniti.id/0036d301-23f1-40cf-8bc6-7940e0466908\" alt=\"pm 4a\" width=\"36\" height=\"21\" srcset=\"https://www.brainacademy.id/hs-fs/hubfs/pm 4a.png?width=18&height=11&name=pm 4a.png 18w, https://www.brainacademy.id/hs-fs/hubfs/pm 4a.png?width=36&height=21&name=pm 4a.png 36w, https://www.brainacademy.id/hs-fs/hubfs/pm 4a.png?width=54&height=32&name=pm 4a.png 54w, https://www.brainacademy.id/hs-fs/hubfs/pm 4a.png?width=72&height=42&name=pm 4a.png 72w, https://www.brainacademy.id/hs-fs/hubfs/pm 4a.png?width=90&height=53&name=pm 4a.png 90w, https://www.brainacademy.id/hs-fs/hubfs/pm 4a.png?width=108&height=63&name=pm 4a.png 108w\" sizes=\"(max-width: 36px) 100vw, 36px\" class=\"fr-fic fr-dii\">, perubahan entalpi <img src=\"blob:https://cbt.meniti.id/67cf6300-1f19-4c95-848e-be919d3fe80e\" alt=\"pm 4b\" width=\"34\" height=\"19\" srcset=\"https://www.brainacademy.id/hs-fs/hubfs/pm 4b.png?width=17&height=10&name=pm 4b.png 17w, https://www.brainacademy.id/hs-fs/hubfs/pm 4b.png?width=34&height=19&name=pm 4b.png 34w, https://www.brainacademy.id/hs-fs/hubfs/pm 4b.png?width=51&height=29&name=pm 4b.png 51w, https://www.brainacademy.id/hs-fs/hubfs/pm 4b.png?width=68&height=38&name=pm 4b.png 68w, https://www.brainacademy.id/hs-fs/hubfs/pm 4b.png?width=85&height=48&name=pm 4b.png 85w, https://www.brainacademy.id/hs-fs/hubfs/pm 4b.png?width=102&height=57&name=pm 4b.png 102w\" sizes=\"(max-width: 34px) 100vw, 34px\" class=\"fr-fic fr-dii\">, perubahan entropi <img src=\"blob:https://cbt.meniti.id/48f4bef6-7c3b-476e-bd40-f08607e1d4e6\" alt=\"pm 4c\" width=\"31\" height=\"22\" srcset=\"https://www.brainacademy.id/hs-fs/hubfs/pm 4c.png?width=16&height=11&name=pm 4c.png 16w, https://www.brainacademy.id/hs-fs/hubf