(1198, 30, 27, 1, '', '', '<p>The question is based on the following passage. Supply chain weaknesses were brought to the forefront during the COVID-19 pandemic, especially for industries relying on electronics, as the flow of raw materials slowed or sometimes stopped. On top of that, shifting consumer values and tougher environmental regulations have resulted in more people buying hybrid vehicles. The batteries in these cars require rare metals that, depending on their supplies, can have volatile and unpredictable prices. However, there are other scarce elements and materials that may be used in smaller amounts in hybrid models versus conventional gas vehicles, raising the question of how these vehicles really compare with regard to supply chain vulnerabilities. Randolph Kirchain and colleagues wanted to develop a comprehensive comparison of the elements and compounds that go into all the parts in gas-powered, self-charging hybrid and plug-in hybrid cars, calculating each of the three vehicles&#39; materials cost vulnerability. The researchers collected information on the compounds in the more than 350,000 parts used to build seven vehicles from the same manufacturer with different levels of electrification, including four sedans and three sport utility vehicles (SUVs). Then, they calculated the amount of the 76 chemical elements present, as well as a few other materials, in each car type. To develop a monetary metric for vulnerability, the team considered the weight of each component, along with its average price and price volatility between 1998 and 2015. The results showed that self-charging hybrid and plug-in hybrid vehicles have twice the raw material cost risks. The largest contributors to the increase in cost risks were battery-related elements, such as cobalt, nickel, graphite and neodymium. The researchers say that as manufacturers ramp up electric vehicle production to meet demand, reducing raw material cost risks with long-term supplier contracts, substituting some materials or recycling others will be a good idea.</p><p>The author would apparently agree that the relationship between environmental regulations and the purchase of hybrid vehicles in paragraph 1 is similar to the phenomenon of ....</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>modern life and electric cars</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>gasoline and transportation</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>people and vehicles</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>oil and gas stations</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>cars and traffic</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676277973, 1676277973);
