(1201, 30, 27, 1, '', '', '<p>The question is based on the following text.</p><p>Exercise is painful. As the cliché goes, “No pain, no gain.” When the body exerts itself, pumping action out of muscles to tear them down and build their mass, it’s left with a soreness. Doctors, coaches, and mothers all recommend heat for tense sore muscles—warm baths, moist towels, hot-water bottles, or heated pads as thermotherapy techniques. But how exactly does applying this heat help the pain and relax the muscles?    While exercising, the body requires more energy than it can produce through aerobic respiration, or the intake of oxygen. To create enough energy for vigorous movement, the body goes through another process: anaerobic respiration. This type of energy production burns sugars without oxygen, producing lactic acid within exerted muscles. Overworked muscles and a buildup of lactic acid are what cause the pain associated with exercising. When heat is applied to a sore area of the body, blood vessels widen and blood flow increases to transport excess lactic acid and other toxins away from tired muscles. These muscles are also made more elastic by the heat, and nerve endings are stimulated to block pain signals.</p><p>What is the purpose of the underlined sentence in paragraph 1?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>define the cliché “No pain, no gain”</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>show the process of soreness on muscles</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>explain the sources of pain while exercising</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>illustrate the cliché related to exercise and pain</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>highlight the process of muscle building during exercise</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676278155, 1676278155),
(1202, 30, 27, 1, '', '', '<p>1. Teks ini digunakan untuk menjawab soal berikut.    (1) Pada 16 November 2010, angklung diakui sebagai Warisan Budaya Dunia Kategori Tak Benda oleh UNESCO. (2) Namun, pelestarian angklung di Indonesia tentu menghadapi hambatan. (3) Perkara klasik seperti tidak adanya regenerasi, baik dari sisi seniman maupun perajin angklung, masih menjadi masalah utama. (4) Bahkan, setelah lebih dari 10 tahun ditetapkan sebagai warisan budaya dunia, angklung tak banyak memiliki peminat dalam tataran generasi muda.    (5) Padahal, perkembangan angklung di mancanegara justru menunjukkan kecenderungan positif. (6) Angklung sedikitnya dimainkan di 131 negara, baik di sekolah maupun komunitas. (7) Sebagai contoh, di Amerika Serikat, alat musik Sunda itu dimainkan di universitas-universitas di Pennsylvania dan Hawaii. (8) Melihat hal itu, ada paradoks yang nyata: angklung diminati di negara lain, tetapi ditinggalkan di negara asalnya. (9) Oleh karena itu, regenerasi pemain angklung di Indonesia saat ini perlu menjadi perhatian dari semua pihak. (10) Pembuatan program pelestarian angklung juga menjadi hal yang penting. (11) Angklung mungkin harus dimasukkan ke dalam kurikulum sekolah dari jenjang dasar untuk menjaga kelestariannya. Apa gagasan utama paragraf pertama?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A.Ada berbagai hambatan dalam pelestarian angklung di Indonesia</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B. Angklung ditetapkan sebagai warisan budaya dunia oleh UNESCO</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C. Angklung merupakan warisan budaya UNESCO yang sepi peminat </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p> D. Angklung ditetapkan sebagai warisan budaya dunia meskipun tak banyak diminati</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E. Angklung sulit dilestarikan meskipun sudah jadi warisan budaya dunia.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676278196, 1676278196),
(1203, 30, 27, 1, '', '', '<p>Read the text below to answer the question!</p><p>A team led by UC Riverside geologists has discovered the first ancestor on the family tree that contains most familiar animals today, including humans. The tiny, wormlike creature, named Ikaria wariootia, is the earliest bilaterian, or organism with a front and back, two symmetrical sides, and openings at either end connected by a gut. The paper is published today in Proceedings of the National Academy of Sciences.    For 15 years, scientists agreed that fossilized burrows found in 555 million-year-old Ediacaran Period deposits in Nilpena, South Australia, were made by bilaterians. However, there was no sign of the creature that made the burrows, leaving scientists with nothing but speculation. Then, Scott Evans, a recent doctoral graduate from UC Riverside; and Mary Droser, a professor of geology, noticed miniscule, oval impressions near some of these burrows. With funding from a NASA exobiology grant, they used a three-dimensional laser scanner that revealed the regular, consistent shape of a cylindrical body with a distinct head and tail and faintly grooved musculature. The animal ranged between 2-7 millimeters long and about 1-2.5 millimeters wide, with the largest the size and shape of a grain of rice -- just the right size to have made the burrows.    \"We thought these animals should have existed during this interval, but always understood they would be difficult to recognize,\" Evans said. \"Once we had the 3D scans, we knew that we had made an important discovery.\"</p><p>What is the main idea of the passage?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>the geologists’ discovery of a worm in Australia</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>the small ancestor of familiar animals identified in Australia</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Australian geologists finding most animals</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>a team led by UC Riverside geologists</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>the descendant on the family tree of familiar animals found in Australia</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676278326, 1676278326),
(1204, 30, 27, 1, '04656c0b343fd790c49c77d8e6498ecd.png', 'image/png', '<p>6. Pajak Penghasilan (PPh) berdasarkan UU PPh didefinisikan sebagai pajak yang dikenakan kepada orang pribadi atau badan atas penghasilan yang diperoleh dalam tahun pajak. Untuk Penghasilan Tidak Kena Pajak (PTKP), karyawan yang memiliki status belum menikah dan tidak memiliki tanggungan adalah Rp54.000.000,00 per tahun. PPh termasuk ke dalam pajak progresif sehingga tarif pajak yang akan makin naik sesuai dengan naiknya dasar pengenaan pajak. Diketahui perhitungan tarif PPh berdasarkan pasal 21 sesuai UU PPh didasari oleh Penghasilan Kena Pajak (PKP) dan disajikan dalam tabel berikut.</p><p>Sebagai contoh, untuk penghasilan Andi setelah dikurangi PTKP adalah Rp300.000.000,00 per tahun, maka dikenakan tarif pajak sampai lapis ketiga, yaitu 25%. Pada tarif lapis pertama, Rp60.000.000,00 pertama dikenakan tarif pajak 5%. Kemudian, pada tarif lapis kedua, Rp190.000.000,00 berikutnya (dari 60 juta sampai 250 juta) dikenakan tarif pajak 15%. Selanjutnya, pada tarif lapis terakhir, sisa Rp50.000,000 dikenakan tarif pajak 25%.</p><p>Nisa adalah seorang karyawan tetap di suatu perusahaan dengan status belum menikah dan tidak memiliki tanggungan dengan penghasilan netto sebesar Rp42.500.000,00 per bulan. Persentase tarif PPh progresif yang dikenakan kepada Nisa adalah sampai ....</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>25%</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>5%</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>15%</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>30%</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>35%</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676278423, 1676278423),
(1205, 30, 27, 1, '', '', '<p>Teks ini digunakan untuk menjawab soal nomor 2 dan 3.</p><p><br></p><p>Mengonsumsi Buah yang Benar dan Sehat</p><p><br></p><p>1.Disarankan mengonsumsi buah 20—30 menit sebelum makan. Hal itu akan membuat penyerapan buah oleh tubuh menjadi maksimal. Buah juga akan menjadi detoks yang efektif untuk tubuh jika dikonsumsi dalam keadaan perut kosong. Sementara itu, mengonsumsi buah setelah makan akan membuat penyerapan tubuh atas fruktosa menjadi lebih lambat sehingga memicu begah, bahkan diare atau sakit perut.</p><p><br></p><p>2.Disarankan makan buah satu jam sebelum berolahraga karena buah akan menjadi suntikan nutrisi yang baik dan meningkatkan energi tubuh tanpa membuat kekenyangan atau mual.</p><p><br></p><p>3.Buah segar jauh lebih baik. Buah-buahan memang kaya akan serat dan berbagai vitamin. Namun, tidak demikian dengan buah kalengan, buah beku, atau buah yang telah diproses. Buah yang seperti ini umumnya memiliki kandungan gula yang sangat tinggi, bahkan dapat pula mengandung pengawet atau bahan kimia tambahan lainnya yang bisa membahayakan tubuh.</p><p><br></p><p>2. Berdasarkan pernyataan pada poin 3, dapat diasumsikan bahwa ....</p><p><span xss=removed></span></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A. buah kalengan atau buah beku tidak dapat dikonsumsi karena berbahaya</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B. buah dengan kandungan gula yang tinggi membahayakan kesehatan tubuh.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C. pengawet atau bahan kimia tambahan menyebabkan buah tidak dapat dikonsumsi.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D. kandungan yang tidak baik untuk tubuh mungkin terdapat pada buah beku. </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E. kandungan gula yang tinggi dan pengawet terkandung dalam setiap buah kalengan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676278429, 1676278429),
(1206, 30, 27, 1, '', '', '<p>Read the text below to answer the question!</p><p>A team led by UC Riverside geologists has discovered the first ancestor on the family tree that contains most familiar animals today, including humans. The tiny, wormlike creature, named Ikaria wariootia, is the earliest bilaterian, or organism with a front and back, two symmetrical sides, and openings at either end connected by a gut. The paper is published today in Proceedings of the National Academy of Sciences.    For 15 years, scientists agreed that fossilized burrows found in 555 million-year-old Ediacaran Period deposits in Nilpena, South Australia, were made by bilaterians. However, there was no sign of the creature that made the burrows, leaving scientists with nothing but speculation. Then, Scott Evans, a recent doctoral graduate from UC Riverside; and Mary Droser, a professor of geology, noticed miniscule, oval impressions near some of these burrows. With funding from a NASA exobiology grant, they used a three-dimensional laser scanner that revealed the regular, consistent shape of a cylindrical body with a distinct head and tail and faintly grooved musculature. The animal ranged between 2-7 millimeters long and about 1-2.5 millimeters wide, with the largest the size and shape of a grain of rice -- just the right size to have made the burrows.    \"We thought these animals should have existed during this interval, but always understood they would be difficult to recognize,\" Evans said. \"Once we had the 3D scans, we knew that we had made an important discovery.\" </p><p>The purpose of the passage is …</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>to reveal the sophisticated new science technology</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>to inform the readers about the important discovery</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>to advertise an ancient animal found in Australia</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>to deliver the information about several ancestors</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>to announce how great a team of geologists is</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676278529, 1676278529),
