(1209, 30, 27, 1, '', '', '<p>4. Teks ini digunakan untuk menjawab soal berikut.</p><p><br></p><p>     (1) Perubahan sosial adalah perubahan pada masyarakat yang memengaruhi sistem sosial masyarakat, termasuk nilai-nilai, sikap, hingga pola perilaku. (2) Perubahan sosial akan selalu terjadi di masyarakat. (3) Manusia merupakan makhluk sosial yang senantiasa berkembang sekaligus berupaya untuk mencapai kehidupan yang lebih baik sehingga dinamika perubahan sosial tidak bisa dihindari.</p><p><br></p><p>    (4) Menurut Idraddin dan Irwan terdapat tiga dimensi dalam perubahan sosial, yaitu struktur sosial, interaksi sosial, dan budaya. (5) Berdasarkan tiga dimensi tersebut muncullah istilah perubahan sosial-budaya yang mencakup perubahan pada tingkatan kehidupan sosial dan budaya. (6) Hal itu dapat memberikan dampak di berbagai bidang yang saling memengaruhi atau memiliki hubungan timbal balik.</p><p><br></p><p>    (7) Perubahan sosial-budaya menyebabkan berkembangnya inovasi teknologi karena adanya modernisasi dan kemajuan ilmu pengetahuan. (8) Adanya inovasi teknologi tersebut dapat meningkatkan efektivitas dan efisiensi kerja serta menyebabkan eskalasi tenaga profesional. (9) Di sisi lain, perubahan sosial-budaya menyebabkan munculnya kesenjangan sosial-ekonomi karena tidak semua masyarakat memiliki kapasitas untuk meningkatkan taraf hidupnya. (10) Selain itu, perubahan sosial-budaya dapat menyebabkan disorientasi nilai dan norma budaya sehingga dapat memicu perilaku menyimpang, seperti kenakalan remaja.</p><p><br></p><p>Paragraf 3 bacaan tersebut berfungsi untuk ....  </p><p><br></p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A. melanjutkan pembahasan berdasarkan gagasan utama paragraf pertama </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B. menyimpulkan penyebab permasalahan yang diuraikan paragraf kedua  </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C. memerinci pembahasan yang telah dijelaskan pada paragraf sebelumnya </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D. memberikan bukti empirik berdasarkan hal yang dijelaskan pada kalimat (5) </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E. menguraikan implementasi yang dibahas pada paragraf sebelumnya</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'C', 1676278741, 1676278741),
(1210, 30, 27, 1, '', '', '<p>The text is for the following question.</p><p>Television was once the newest technology in our homes, and then came videos and computers. Today’s children are growing up in a rapidly changing digital age that is far different from their parents. A variety of technologies are all around us in our homes, offices, and schools. When used wisely, technology and media can support learning children’s relationships both with adults and their peers. Based on some evidence by research, there has never been a more important time to apply principles of development and learning when considering the use of cutting-edge technologies and new media as the so-called interactive media. Interactive media refers to digital and analog materials, including software programs, applications (apps), some children’s television programming, e-books, the Internet, and other forms of content designed to facilitate active and creative use by young children and to encourage social engagement with other children and adults.    When the integration of technology and interactive media in early childhood programs is built upon solid developmental foundations, and early childhood professionals are aware of both the challenges and the opportunities, educators are positioned to improve program quality by intentionally leveraging the potential of technology and media for the benefit of every child.    This statement provides guidance for early childhood educators about the use of technology and interactive media in ways that can optimize opportunities for young children’s development. In this statement, the definition of technology tools encompasses a broad range of digital devices such as computers, tablets, multi-touch screens, interactive whiteboards, mobile devices, cameras, audio recorders, electronic toys, games, e-book readers, and older analog devices still being used such as tape recorders, record and cassette players, projectors, and microscopes.    By appropriately and intentionally using the technology of his day—broadcast television—to connect with each individual child and with parents and families, it demonstrated the positive potential of using technology and media in ways that are grounded in principles of child development.</p><p>How does the second sentence relate to the first sentence in paragraph 2?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>It shows that interactive media can support social engagement among adults.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>It states that the children and adults nowadays are familiar with digital technology.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>It shows the importance of interactive media to children’s lives.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>It argues that interactive media include digital materials only.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>It explains the definition and examples of interactive media.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676278793, 1676278793),
