(1213, 30, 27, 1, '', '', '<p>The question is based on the following passage.</p><p>Around 2.8 million Indian students sat university examinations from the end of August to September 13 as the country approached the grim milestone of 5-million total COVID-19 cases. Despite pleas from civil society to defer examinations, including by Swedish climate activist Greta Thunberg, a Supreme Court ruling on August 17 gave the government the green light to keep the original schedule for the engineer and medical colleges entrance exams.    The JEE and the NEET, how university exams for those two careers are called, are India&#39;s most competitive — they sprawl industries of their own, with preparation courses generating millions of dollars annually. The court bench headed by Justice Ashok Bhushan said that “the career of the students cannot be put on peril for long, and a full academic year cannot be wasted.” The court will not hear any further petitions regarding postponing future exam dates.    According to the Ministry of Education, 74 percent of the students registered to the first of the JEE took the exam, while an above 80-percent attendance was observed for the NEET exam. Students are now gearing up for the second stage of the JEE (the JEE Advanced), which will take place on September 27. Protests against the exam date have dwindled since the Supreme Court decision.</p><p>What can be inferred from the passage?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The university entrance tests were finally rescheduled.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The Supreme Court considered the pleas from society.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Indian students were forced to sit the JEE and the NEET exam.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>The JEE and the NEET are annually held by the Supreme Court.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Indian students were reluctant to join university preparation courses.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676279208, 1676279208),
