(1215, 30, 27, 1, '', '', '<p>The question is based on the following passage.</p><p>Around 2.8 million Indian students sat university examinations from the end of August to September 13 as the country approached the grim milestone of 5-million total COVID-19 cases. Despite pleas from civil society to defer examinations, including by Swedish climate activist Greta Thunberg, a Supreme Court ruling on August 17 gave the government the green light to keep the original schedule for the engineer and medical colleges entrance exams.    The JEE and the NEET, how university exams for those two careers are called, are India&#39;s most competitive — they sprawl industries of their own, with preparation courses generating millions of dollars annually. The court bench headed by Justice Ashok Bhushan said that “the career of the students cannot be put on peril for long, and a full academic year cannot be wasted.” The court will not hear any further petitions regarding postponing future exam dates.    According to the Ministry of Education, 74 percent of the students registered to the first of the JEE took the exam, while an above 80-percent attendance was observed for the NEET exam. Students are now gearing up for the second stage of the JEE (the JEE Advanced), which will take place on September 27. Protests against the exam date have dwindled since the Supreme Court decision.</p><p>The author’s attitude towards the civils’ protest regarding the exam schedule is ….</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>informative</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>subjective</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>objective</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>positive</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>critical</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676279466, 1676279466),
(1216, 30, 27, 1, 'b8601c4a601229f36eb926f0f0205ee7.png', 'image/png', '<p>8. Tujuh buah silinder dengan jari-jari 7 cm disusun dan dibungkus sehingga membentuk tampak atas seperti gambar berikut.</p><p>Jika volume total silinder sebesar 10.780 cm<sup>3</sup>, volume antar ruang yang terbentuk sebesar ....</p><p>Catatan: Gunakan <img data-fr-image-pasted=\"true\" src=\"https://www.brainacademy.id/hs-fs/hubfs/pm 8b.png?width=51&height=33&name=pm 8b.png\" alt=\"pm 8b\" width=\"51\" height=\"33\" srcset=\"https://www.brainacademy.id/hs-fs/hubfs/pm 8b.png?width=26&height=17&name=pm 8b.png 26w, https://www.brainacademy.id/hs-fs/hubfs/pm 8b.png?width=51&height=33&name=pm 8b.png 51w, https://www.brainacademy.id/hs-fs/hubfs/pm 8b.png?width=77&height=50&name=pm 8b.png 77w, https://www.brainacademy.id/hs-fs/hubfs/pm 8b.png?width=102&height=66&name=pm 8b.png 102w, https://www.brainacademy.id/hs-fs/hubfs/pm 8b.png?width=128&height=83&name=pm 8b.png 128w, https://www.brainacademy.id/hs-fs/hubfs/pm 8b.png?width=153&height=99&name=pm 8b.png 153w\" sizes=\"(max-width: 51px) 100vw, 51px\" class=\"fr-fic fr-dii\"></p><p><br></p><p><br></p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '7916c9f0dace6d751b25c327683bbe7c.png', '875f66a6bc1cb9806deb2c00828d91e8.png', 'cef45f89be01ac6c1a679f026de8085c.png', 'f7ecd1567ddb255bf1f81ed579bcd58b.png', 'ed66e45cab14880b46a74705084fbfe1.png', 'C', 1676279523, 1676279572),
(1217, 30, 27, 1, '', '', '<p>Teks ini digunakan untuk menjawab soal nomor 5,6, dan 7.</p><p>     (1) Sebuah penelitian dari University of Manchester mengungkapkan bahwa penggunaan media sosial berkontribusi terhadap kesehatan mental yang buruk di Indonesia. (2) Para peneliti menyurvei 22.423 individu berusia 20 tahun ke atas yang menggunakan media sosial daring Facebook, Twitter, dan lainnya. (3) Penelitian ini menunjukkan bahwa penggunaan media sosial membahayakan kesehatan mental orang dewasa. (4) Peningkatan satu standar deviasi dalam penggunaan media sosial oleh orang dewasa setara dengan peningkatan 9 persen dalam skor CES-D (Center for Epidemiologic Studies Depression Scale) yang merupakan alat ukur untuk gejala depresi.</p><p>    (5) Berdasarkan survei Riset Kesehatan Dasar Indonesia terbaru, prevalensi individu dengan gangguan jiwa karena media sosial di tanah air diperkirakan 11,8 juta orang. (6) Hal ini menunjukkan bahwa teknologi dapat memiliki sisi negatif. (7) Oleh karena itu, pejabat kesehatan masyarakat harus berpikir kreatif untuk menemukan cara agar masyarakat menyadari konsekuensi negatif dari media sosial. (8) Pengguna media sosial daring juga harus bijak dalam menggunakan media sosial untuk mencegah peningkatan penyakit mental.</p><p>5.Bacaan tersebut tersusun atas beberapa kalimat yang membahas kontribusi media sosial terhadap kesehatan mental masyarakat Indonesia. Informasi-informasi dalam bacaan itu saling berkaitan, termasuk pada kalimat (2) dan (3). Jika kamu membaca dengan saksama, hubungan apa yang terdapat di antara kalimat (2) dan kalimat (3)? </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A. Hubungan penjelasan dari informasi yang memuat survei terhadap 22.423 individu berusia 20 tahun ke atas yang menggunakan media sosial daring Facebook, Twitter, dan lainnya</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B. Hubungan pemerincian dari penelitian terkait penggunaan media sosial yang membahayakan kesehatan mental individu yang berusia 20 tahun ke atas di Indonesia</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C. Hubungan pembuktian terkait hasil survei yang dilakukan University of Manchester tentang media sosial daring Facebook, Twitter, dan lainnya terhadap kesehatan mental masyarakat Indonesia.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D. Hubungan penambahan informasi yang berkaitan dengan penggunaan media sosial daring Facebook, Twitter, dan lainnya dan dampaknya terhadap kesehatan mental. </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E. Hubungan penegasan dari informasi yang sudah dijelaskan sebelumnya, yakni mengenai survei dampak penggunaan media sosial terhadap kesehatan</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676279685, 1676279685),
(1218, 30, 27, 1, '', '', '<p>Setiap peserta ujian sedang berpikir,maka:</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Jika si A bukan peserta ujian,maka ia tidak sedang berpikir.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Jika si A Sekarang Sedang berpikir,maka ia bukan peserta ujian.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Jika si A Sedang berpikir,maka ia peserta ujian.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Jika si A sekarang tidak berpikir, maka ia peserta ujian.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Jika si A sedang berpikir maka si A bukan peserta ujian.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'C', 1676338040, 1676338040),
(1219, 30, 27, 1, 'f0cdeb223c84530fa384e66cbc77453d.png', 'image/png', '<p>9. Berdasarkan perspektif ekonomi, usia penduduk dikategorikan menjadi dua bagian, yaitu usia produktif (15—59 tahun) dan usia tidak produktif (di bawah 15 tahun dan 60 tahun ke atas). Jumlah penduduk pada suatu negara tahun 2021 tercatat sebagai berikut.</p><p>Persentase penduduk yang berada pada kategori usia tidak produktif di negara tersebut adalah sekitar ....</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>42,25%</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>33,58%</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>9,05%</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>24,52%</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>66,67%</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676338508, 1676338508),
(1220, 30, 27, 1, '', '', '<p>6.Bagaimana sikap penulis dalam bacaan tersebut?</p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A.Prihatin karena penggunaan media sosial yang berlebihan berdampak bagi kesehatan mental. </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B. Menentang penggunaan media sosial daring Facebook, Twitter, dan lain-lain yang menyebabkan gangguan mental.  </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C. Meyakinkan dampak penggunaan media sosial daring yang berbahaya bagi kesehatan mental. </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D. Resah terhadap hasil penelitian dari University of Manchester bahwa media sosial berdampak pada kesehatan mental.  </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E. Cemas karena penggunaan media sosial yang berlebihan dapat menyebabkan gangguan mental.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676338634, 1676338634),
(1221, 30, 27, 1, '', '', '<p>7.Berdasarkan teks tersebut, dampak yang sangat mungkin muncul apabila penggunaan media sosial semakin meningkat adalah .... </p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A. media sosial makin berisiko terhadap peningkatan gangguan mental masyarakat.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B. kesehatan mental seseorang yang berusia kurang dari 20 tahun makin buruk.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C. makin banyaknya individu berusia 20 tahun ke atas dengan gangguan jiwa di dunia.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D. pejabat kesehatan masyarakat melarang penggunaan media sosial.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E. masyarakat makin tidak menyadari konsekuensi negatif media sosial.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676338804, 1676338804),
(1222, 30, 27, 1, '', '', '<p>10. Permintaan jastip atau jasa titip cukup tinggi di Indonesia, salah satunya dalam hal pembelian tiket konser. Rani, seorang penggemar K-pop, ingin membeli tiket konser untuk pertama kalinya. Karena takut gagal jika membeli sendiri, Rani memutuskan menggunakan jastip. Ia membandingkan beberapa akun jastip pembelian tiket untuk mengetahui kemungkinan keberhasilannya. Berikut data hasil perbandingannya.</p><p>Dari data tersebut, pernyataan yang BENAR adalah ... </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Persentase keberhasilan akun C lebih kecil dari akun D.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Persentase keberhasilan akun D adalah yang paling kecil.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Persentase keberhasilan akun E bukanlah yang paling besar.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Persentase keberhasilan akun A lebih besar dari akun B.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Persentase keberhasilan akun E lebih kecil dari akun F.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676338850, 1676338850),
(1223, 30, 27, 1, '', '', '<p>Teks ini digunakan untuk menjawab soal nomor 8 dan 9.</p><p>     (1) Para peneliti dari Jepang menemukan bahwa dalam skala waktu geologis, satu spesies pohon hutan hujan tropis telah mengalami banyak perubahan. (2) Dalam sebuah laporan penelitian terbaru, para peneliti dari University of Tsukuba mengungkapkan bahwa Shorea parvifolia, spesies pohon hutan hujan tropis, telah mengalami ekspansi populasi yang cepat di Borneo. (3) Hal ini menunjukkan bahwa pemahaman tentang masa lalu spesies menjadi kunci untuk memastikan keberadaannya pada masa depan.</p><p>    (4) Profesor Yoshihiko Tsumura, sebagaimana dilansir EurekAlert, mengatakan bahwa Shorea parvifolia tersebar luas di Asia Tenggara. (5) Struktur genetik Shorea parvifolia dipengaruhi oleh fluktuasi glasial dan interglasial yang berulang. (6) Perubahan genetik ini memberikan pengetahuan untuk memastikan keberadaannya pada masa depan. (7) Untuk memeriksa genetiknya, para peneliti mengambil sampel daun dari pohon dalam populasi alami yang mencakup hampir seluruh rentang geografis S. parvifolia. (8) Tim menggunakan penanda DNA nukleus dan data pengurutan DNA dari kloroplas (struktur sel tumbuhan yang melakukan fotosintesis) untuk memeriksa struktur genetik spesies tersebut. (9) Analisis DNA tersebut menunjukkan bahwa S. parvifolia telah mengalami ekspansi populasi baru-baru ini di Borneo. (10) Spesies ini kemungkinan besar bermigrasi dari Semenanjung Malaya ke Borneo dan kemudian mengalami peningkatan populasi besar sehingga menghasilkan keragaman genetik yang cukup besar.</p><p><br></p><p>8.Topik yang dibahas pada bacaan tersebut adalah …</p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A. Beberapa perubahan yang terjadi pada Shorea parvifolia.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B. Penelitian tentang Shorea parvifolia oleh para peneliti dari Jepang.  </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C. Penggunaan DNA untuk meneliti genetika Shorea parvifolia.  </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D. Pentingnya penelitian tentang Shorea parvifolia untuk masa depan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E. Shorea parvifolia baru-baru ini mengalami ekspansi populasi.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676339042, 1676339042),
