(1228, 30, 27, 1, '', '', '<p>10. Teks ini digunakan untuk menjawab soal berikut.</p><p><br></p><p>    (1) Bunuh diri masih menjadi masalah nyata di berbagai negara di dunia, termasuk Indonesia. (2) Berdasarkan data World Health Organization (WHO), setiap tahun, ada 800 ribu orang yang meninggal karena bunuh diri. (3) Dengan kata lain, setiap 40 detik, ada setidaknya satu orang yang bunuh diri. (4) Sementara itu, di Indonesia, ada sekitar 16 ribu kasus percobaan bunuh diri setiap tahun. (5) Angka tersebut pun diperkirakan belum mencerminkan kondisi yang real karena masih banyak kasus bunuh diri yang belum terdata. (6) Bahkan, berdasarkan hasil riset, angka kasus bunuh diri di Indonesia terus meningkat, terutama dalam situasi pandemi seperti sekarang ini. (7) Oleh karena itu, sudah sepantasnya kasus bunuh diri mendapat perhatian dari berbagai pihak.</p><p><br></p><p>    (8) Di sisi lain, upaya pencegahan bunuh diri pun sangat penting untuk dilakukan, baik oleh pihak berwenang maupun diri kita sebagai bagian dari masyarakat. (9) Tidak harus muluk-muluk dengan melakukan hal-hal besar, beberapa hal sederhana justru dapat menjadi opsi yang tepat. (10) Pencegahan bunuh diri dapat dimulai dengan mengenali ciri seseorang yang ingin bunuh diri. (11) Umumnya, orang yang berkeinginan untuk bunuh diri akan sering membicarakan kegelisahan yang dialami serta kematian. (12) Selain itu, mereka biasanya stres, sulit tidur karena gangguan jiwa, dan akhirnya menarik diri dari aktivitas sehari-hari, keluarga, serta orang lain. (13) Dengan mengenali ciri-ciri tersebut, kita dapat menolong orang-orang terdekat yang memiliki keinginan untuk bunuh diri.</p><p><br></p><p>Ilustrasi yang paling tepat untuk melengkapi penjelasan pada bacaan tersebut adalah .... </p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A. bagan langkah-langkah pertolongan untuk orang yang ingin bunuh diri </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B. tabel jumlah kasus bunuh diri di negara maju di dunia </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C. tabel persebaran kasus bunuh diri di dunia selama pandemi </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D. infografik dampak bunuh diri terhadap populasi penduduk dunia </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E. diagram perbandingan jumlah kasus bunuh diri di Indonesia dan negara lain</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676339515, 1676339515),
(1229, 30, 27, 1, '', '', '<p><strong>14. </strong><strong>Perhatikan ilustrasi berikut!</strong><strong><br></strong></p><p><strong>Gedung Teater</strong></p><p>Dalam suatu gedung teater di Provinsi Suka-Suka terdapat 11 baris kursi. Baris pertama berisi 10 kursi, baris kedua berisi 15 kursi, baris ketiga berisi 17 kursi, baris keempat berisi 22 kursi, baris ke lima berisi 24 kursi, dan seterusnya mengikuti pola yang sama. </p><p>Apabila dalam suatu pertunjukan teater hanya terisi setengah dari total kapasitas gedung dan harga tiket pertunjukan adalah Rp30.000,00 per orang, total pendapatan dari pertunjukan tersebut adalah ….</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp4.650.000,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp3.650.000,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp2.325.000,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp9.300.000,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>RP6.975.000,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676339597, 1676339597),
(1230, 30, 27, 1, '', '', '<p>11. Perhatikan ilustrasi berikut!</p><p><br></p><p>Budi mendapat tugas menulis esai tentang tindak korupsi. Saat melakukan riset untuk menentukan topik esainya, ia menemukan informasi berikut.</p><p><br></p><p>Dana Desa Rentan Disalahgunakan</p><p><br></p><p>    Undang-undang No 6 Tahun 2014 tentang Desa mewajibkan pemerintah pusat untuk mengalokasikan dana desa dari anggaran nasional untuk peningkatan pelayanan publik, pemberdayaan masyarakat dan pembangunan desa. Menurut catatan Kementerian Desa Pembangunan Daerah Tertinggal dan Transmigrasi (Kemendes PDTT) hingga akhir tahun 2016 setidaknya terbangun lebih dari 120.000 km jalan, 1.960 km jembatan, 5.220 unit pasar desa, pembangunan tambatan perahu sebanyak 5.116 unit, pembangunan embung 2.047 unit, dan pembangunan irigasi sebanyak 97.176 unit. Selain itu, pembangunan penahan tanah sebanyak 291.393 unit, pembangunan sarana air bersih 32.711 unit, pembangunan MCK 82.356 unit, pembangunan poliklinik desa 6.041 unit, dan pembangunan sumur 45.865 unit.</p><p><br></p><p>    Akan tetapi, berbagai bentuk penyalahgunaan dana desa juga tidak sedikit. Berdasarkan hasil pemantauan Indonesia Corruption Watch, sepanjang 2015 sampai 2017, kasus tindak pidana korupsi di tingkat desa semakin menjamur. Pada 2015 setidaknya ada 17 kasus, jumlah ini meningkat menjadi 41 kasus pada 2016 dan 96 kasus pada 2017. Jika di total, dalam kurun waktu 3 tahun, setidaknya ada 154 kasus korupsi di tingkat desa dengan kerugian negara mencapai Rp 47,56 miliar.</p><p><br></p><p>    Terdapat 154 kasus korupsi di tingkat desa, 127 diantaranya terkait dana desa. Latar belakang pelaku yang paling banyak terlibat korupsi di tingkat desa adalah kepala desa yaitu 112 orang. Selebihnya merupakan perangkat desa 32 orang dan keluarga kepala desa 3 orang. Data ini memperlihatkan masih buruknya tata kelola dana desa. Bahkan kepala desa dan perangkat desa yang seharusnya mengelola dana desa untuk kepentingan masyarakat justru menjadi bagian dari praktek penyimpangan.</p><p>Setelah membaca artikel tersebut, topik apa yang mungkin Budi pilih untuk esainya?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A.Undang-undang No 6 Tahun 2014 tentang Desa.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B.Bukti-bukti pemanfaatan Dana Desa.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C.Dana Desa bagi pembangunan daerah tertinggal.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D.Pemaparan tata kelola Dana Desa.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E.Modus penyelewengan Dana Desa.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676339669, 1676339669),
(1231, 30, 27, 1, '', '', '<p>12.Perhatikan ilustrasi berikut!</p><p><br></p><p>Setelah menentukan topik untuk tugas esai tentang tindak korupsi, Budi mencari data yang berkaitan dengan korupsi Dana Desa. Dalam pencariannya, Budi menemukan sebuah artikel yang memuat informasi seperti yang ia inginkan. Namun, Budi menemukan sebuah kejanggalan dalam artikel tersebut sehingga Budi pun batal menggunakannya sebagai sumber. Berikut bagian artikel yang memuat kejanggalan itu.</p><p><br></p><p>Tambah Dananya, Tambah Korupsinya</p><p><br></p><p>    Penambahan anggaran Dana Desa ternyata disertai juga dengan peningkatan angka kasus korupsinya. Pada tahun 2015, pemerintah mengalokasikan Rp 20,67 triliun untuk Dana Desa, disusul dengan Rp 46,98 triliun di tahun 2016. Alokasi ini meningkat hingga Rp 60 triliun di tahun 2017 dan 2018. Angka penyerapan Dana Desa di tahun-tahun tersebut menunjukkan kenaikan dari 82,72 persen di tahun 2015 hingga 97,65 persen di 2016 dan 98,54 persen di 2017 hingga 99 persen di 2018. Sayangnya, kasus korupsi Dana Desa di tahun-tahun tersebut juga mengiringi kenaikan-kenaikan tersebut. Ada 17 kasus di tahun 2015, 41 kasus di 2017, 96 kasus di 2017, dan 27 kasus di semester pertama tahun 2018.</p><p><br></p><p>Kejanggalan apa yang ditemukan oleh Budi?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A.Penyerapan Dana Desa dari tahun ke tahun tidak sama.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B.Besaran kenaikan Dana Desa dari tahun ke tahun tidak sama.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C.Tidak ada informasi mengenai rincian alokasi Dana Desa yang diselewengkan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D.Angka kasus korupsi di tahun 2018 diambil sebagai indikator sebagai peningkatan. </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E.Tidak ada informasi mengenai jabatan pelaku korupsinya dalam pemerintahan desa.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676339789, 1676339789),
(1232, 30, 27, 1, '', '', '<p><strong>15. </strong><strong>Perhatikan ilustrasi berikut!</strong></p><p><strong>Premi Asuransi Kesehatan</strong></p><p>Dua orang karyawan swasta mendaftar sebagai peserta asuransi kesehatan dengan besar premi yang sama. Guna membayar premi asuransi tersebut, karyawan A yang memiliki gaji Rp6.000.000,00 akan dikenakan potongan gaji sebesar 4%, sedangkan karyawan B dikenakan potongan gaji sebesar 6%.</p><p>Berdasarkan informasi tersebut, besar gaji karyawan B adalah ….</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp3.500.000,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp5.000.000,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp4.000.000,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp5.500.000,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Rp5.000.000,00</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'C', 1676339816, 1676339816),
(1233, 30, 27, 1, '', '', '<p>13.Perhatikan ilustrasi berikut!</p><p><br></p><p>Budi memerlukan sumber tambahan untuk menyokong sebuah ide yang hendak ia masukkan ke dalam esainya. Setelah melakukan pencarian, Budi memutuskan untuk menggunakan sebuah artikel sebagai salah satu sumber pustaka esainya. Berikut artikel yang ditemukan Budi.</p><p><br></p><p>Desa Ponggok, Bukti Keberhasilan Dana Desa</p><p><br></p><p>    Menteri Keuangan (Menkeu) melakukan kunjungan ke Desa Ponggok dan merasa bangga akan pencapaian pemerintah Desa Ponggok dalam memanfaatkan Dana Desa. Sejak menerima Dana Desa pada tahun 2015, Desa Ponggok telah melakukan banyak pembangunan untuk memajukan desa, mulai dari pembangunan infrastruktur, pembangunan sanitasi dan penyediaan air bersih, sampai dengan peningkatan kualitas sumber daya manusia.</p><p><br></p><p>    “Sore hari ini kita melihat bagaimana Desa Ponggok bisa membangun dirinya. Melakukan upaya perbaikan kesejahteraan masyarakat di bawah kepemimpinan Bapak Juanedhi merupakan suatu prestasi yang sangat sangat sangat membanggakan. Saya berterima kasih,” ujar Menkeu di gedung Banyu Panguripan, Desa Ponggok, pada Rabu (22/08).</p><p><br></p><p>    Pemerintah telah memberikan Dana Desa selama tiga tahun. Desa Ponggok adalah contoh desa yang mampu mengelola dan mengimplementasikan Dana Desa dengan sangat baik. Jika seluruh desa di Indonesia mampu melakukannya, tidak akan ada kemiskinan lagi. Ketimpangan juga semakin kecil sehingga semua lapisan masyarakat dapat merasakan pertumbuhan ekonomi.</p><p><br></p><p>    Selanjutnya, Menkeu menjelaskan bahwa Direktorat Jenderal Perimbangan Keuangan (DJPK) sedang memformulasikan besaran jumlah Dana Desa yang ditransfer ke tiap desa. Dengan formulasi ini, desa yang sudah mandiri akan menerima jumlah yang lebih kecil dibanding desa yang masih belum mandiri agar dapat cepat mengejar ketertinggalannya. Menteri Keuangan, Menteri Dalam Negeri, Menteri Badan Perencanaan Nasional (Bappenas), dan Menteri Desa Pembangunan Daerah Tertinggal dan Transmigrasi (Mendes) akan terus mengevaluasi Dana Desa agar dana ini dapat dimanfaatkan dengan tepat guna dalam mengentaskan kemiskinan dan kesenjangan sehingga dapat tercipta keadilan sosial bagi seluruh rakyat Indonesia</p><p>Apa yang dapat dilakukan Budi dengan artikel tersebut di dalam esainya?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A.Budi dapat memakainya sebagai sumber untuk menjelaskan bagaimana Desa Ponggok mengelola Dana Desa.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B.Budi dapat memakainya sebagai rujukan untuk menyebutkan Bapak Juanedhi sebagai tokoh pemberantasan korupsi.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C.Budi dapat memakainya sebagai alat pembuktian kesuksesan Dana Desa sebagai program pemerintah.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D.Budi dapat memakainya sebagai rujukan untuk menunjukan kerugian masyarakat akibat tindak korupsi.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E.Budi dapat menggunakannya untuk mengevaluasi kebenaran berita dalam artikel tersebut.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676340004, 1676340004),
(1234, 30, 27, 1, '', '', '<p>14.Perhatikan teks berikut untuk menjawab soal no 14,15, dan 16!</p><p><br></p><p>Makanan Cepat Saji atau Makanan Sampah</p><p><br></p><p>    Makanan cepat saji (fast food) adalah makanan yang sudah disiapkan dan bisa disajikan dalam waktu cepat sekitar 5-10 menit setelah dipesan. Menurut Executive Chef Hotel Santika Mega City Bekasi Agung Budiharto, makanan cepat saji itu sama dengan makanan sampah (junk food) karena makanan sampah juga bersifat cepat saji. Agung menambahkan bahwa makanan cepat saji umumnya dibuat dengan bahan makanan yang tidak terlalu banyak. Selain itu, pembuatan makanan cepat saji juga sederhana, tidak memerlukan garnish (dekorasi makanan) atau platting (penyajian di piring) yang detail. Dalam hal pemasakan, teknik goreng dan panggang adalah dua teknik yang umum digunakan dalam pembuatan makanan cepat saji.</p><p><br></p><p>    Agung menjelaskan bahwa beberapa makanan cepat saji umumnya diolah dengan takaran garam yang cukup besar untuk memperpanjang umur simpan makanan. Alhasil, makanan ini memiliki cita rasa gurih yang cenderung asin. Pemberian garam pada makanan merupakan salah satu teknik pengawetan alami. Sementara itu, makanan sampah mengandung banyak lemak, gula, dan garam sehingga membuatnya terasa lezat. Sayangnya, ketiga kandungan makanan sampah tersebut meningkatkan kadar kalori makanan. Selain itu, makanan sampah juga mengandung sedikit saja nutrisi penting, seperti protein, serat, vitamin, dan mineral. Oleh karena kadar kalori yang tinggi, makanan sampah dapat memperburuk kondisi orang yang mengidap diabetes dan hipertensi.</p><p>Pernyataan manakah yang TIDAK relevan dengan keseluruhan isi teks?</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A.Fast food sebenarnya sama dengan dengan junk food karena keduanya merujuk ke makanan yang berbahan baku sederhana.</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B.Orang dengan riwayat kesehatan tertentu sebaiknya tidak mengonsumsi makanan cepat saji.</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C.Makanan cepat saji umumnya dimasak dengan cara digoreng atau dipanggang.</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D.Beberapa kandungan pada makanan cepat saji berbahaya bagi kesehatan</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E.Pemberian garam merupakan salah satu teknik pengawetan alami.</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676340136, 1676340706),
(1235, 30, 27, 1, '', '', '<p><strong>16. Perhatikan ilustrasi berikut!</strong></p><p><strong>Premi Asuransi Kesehatan</strong></p><p>Dua orang karyawan swasta mendaftar sebagai peserta asuransi kesehatan dengan besar premi yang sama. Guna membayar premi asuransi tersebut, karyawan A yang memiliki gaji Rp6.000.000,00 akan dikenakan potongan gaji sebesar 4%, sedangkan karyawan B dikenakan potongan gaji sebesar 6%.</p><p>Pernyataan yang tepat berkaitan dengan informasi tersebut adalah …</p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Total gaji karyawan A dan B setelah dipotong premi asuransi adalah Rp9.520.000,00.</p><p><br></p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Selisih gaji karyawan A dan B sebelum dipotong premi asuransi adalah Rp1.500.000,00.</p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Premi asuransi karyawan A dan karyawan B masing-masing adalah Rp230.000,00.</p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Sisa gaji karyawan B setelah dipotong premi asuransi adalah Rp3.870.000,00.</p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Sisa gaji karyawan A setelah dipotong premi asuransi adalah Rp5.670.000,00.</p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676340191, 1676340191),
(1236, 30, 27, 1, '', '', '<p>15.Pernyataan mana yang merupakan simpulan yang TIDAK logis dalam teks &#39;Makanan Cepat Saji atau Makanan Sampah&#39;?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A.penyamaan fast food dengan junk food</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B.perbandingan antara fast food dan junk food</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C.penyebutan kandungan nutrisi yang tidak lengkap</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D.penyebutan jenis makanan yang memiliki kadar garam tinggi</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E.penyebutan junk food  sebagai makanan sampah</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676340275, 1676340275);
