(1237, 30, 27, 1, '', '', '<p>16.Berdasarkan teks &#39;Makanan Cepat Saji atau Makanan Sampah&#39;, dapat diidentifikasi perbedaan makanan yang disebut dengan fast food  dan junk food, yaitu ....</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>A.fast food dapat disajikan dalam 5-10 menit, sedangkan junk food disajikan dalam waktu lebih lama.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>B.ciri fast food didasarkan pada dari proses penyajian dan junk food pada rendahnya kandungan gizi</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>C.tidak ada perbedaan karena fast food dan junk food merupakan hal yang sama dan benar adanya.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>D.fast food berpotensi lebih sehat dibanding junk food yang kaya akan garam.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>E.fast food  memiliki rasa yang gurih dan junk food  memiliki rasa asin.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676340360, 1676340360),
(1238, 30, 27, 1, '561706f6ffcdae55cf3d99ae158b43af.png', 'image/png', '<p><strong>17. Perhatikan teks berikut!</strong></p><p><strong>Transmigrasi ke Pulau Kalimantan</strong></p><p>Transmigrasi merupakan salah satu upaya pemerintah untuk menyelesaikan masalah ketidakmerataan persebaran penduduk dan pembangunan di wilayah Indonesia. Program transmigrasi sendiri merupakan upaya untuk memindahkan penduduk dari wilayah yang kepadatan penduduknya tinggi ke wilayah yang lebih rendah kepadatannya. Dengan demikian, data kependudukan menjadi salah satu faktor pertimbangan utama dalam program transmigrasi. Salah satu wilayah yang diprioritaskan menjadi wilayah tujuan transmigrasi adalah Pulau Kalimantan yang memiliki kepadatan penduduk cukup rendah. Kepadatan penduduk sendiri merupakan hasil bagi antara jumlah penduduk terhadap luas wilayah. Berikut adalah kondisi kependudukan dari Pulau Kalimantan pada tahun 2019. </p><p>Berdasarkan data tersebut, provinsi di Pulau kalimantan yang akan diprioritaskan untuk menjadi tujuan transmigrasi adalah ….</p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kalimantan Barat</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kalimantan Timur</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kalimantan Selatan</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kalimantan Tengah</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kalimantan Utara</p><p><br></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'E', 1676340498, 1676340498),
(1239, 30, 27, 1, '', '', '<p>17.Perhatikan ilustrasi dan teks berikut untuk menjawab soal nomor 17-18! </p><p><br></p><p>    Setiap orang tentunya ingin sejahtera secara keuangan. Sayangnya, tidak semua orang mengetahui cara mengelola keuangan pribadi yang benar. Padahal, pengelolaan keuangan pribadi yang benar tentu akan mempermudah kita untuk mencapai kesejahteraan keuangan. Terdapat empat strategi pengelolaan keuangan pribadi yang dapat dilakukan untuk meraih kekayaan secara finansial.</p><p><br></p><p>    Strategi pertama adalah menabung dan berinvestasi setiap bulan. Era sekarang ini kita harus memprioritaskan penghasilan yang didapatkan tidak hanya untuk ditabung, tetapi juga untuk berinvestasi. Melalui investasi yang baik, kita bisa mendapatkan keuntungan besar dalam waktu singkat. Strategi kedua adalah penghematan. Salah satu bentuk penghematan yang dapat meningkatkan kesejahteraan adalah mengurangi pengeluaran. Namun, penghematan yang dilakukan lebih kepada pengeluaran yang bersifat konsumtif. Jika diharuskan membeli barang konsumtif, penghematan dapat dilakukan dengan membandingkan harga dan kualitas produk sebelum membeli. Kita dapat membandingkan harga dan kualitas produk di satu toko dengan toko-toko lainnya. Lalu, pilihlah produk dengan kualitas terbaik dan harga termurah agar menghemat pengeluaran. Ketika akan membeli produk keuangan (kartu kredit dan jenis kredit lainnya), kita pun harus membandingkannya terlebih dahulu.</p><p><br></p><p>    Strategi ketiga adalah membuat anggaran. Banyak orang belum menyadari fungsi dan manfaat anggaran. Robert T. Kiyosaki berpendapat, bahwa orang kaya, orang kelas menengah, dan orang miskin perlu membuat anggaran. Jadi, jika perlu membuat anggaran keuangan untuk mengelola keluar masuknya uang dari kantong kita. Strategi keempat adalah menambah pemasukan. Selain penghasilan yang didapat dari kerja aktif, kita perlu menambah penghasilan dari sumber lain atau bisa disebut dengan pendapatan pasif. Contohnya, pemilik rumah kos yang mendapat pendapatan dari penyewaan kamar. Kemudian pengarang atau penulis buku yang mendapat royalti atas karya dan hasil penjualan bukunya. </p><p><br></p><p>Berikut ini, pernyataan yang tepat berkaitan dengan teks tersebut adalah ....</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>mempertimbangkan penggunaan kartu kredit adalah salah satu bentuk penghematan untuk meningkatkan kesejahteraan adalah tugas manager</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>penghematan dapat dilakukan dengan cara menekan pengeluaran kebutuhan yang bersifat prioritas, seperti barang konsumtif.</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>penyewaan properti, pembuatan karya buku dan karya seni dapat membantu meningkatkan penghasilan tambahan selain penghasilan dari kerja aktif</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p><u>penyewaan properti, pembuatan karya buku, dan karya seni dapat membantu meningkatkan penghasilan tambahan selain penghasilan dari kerja aktif</u></p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>mencari penghasilan tambahan dan keuntungan besar melalui investasi yang memiliki risiko terkecil</p><p data-f-id=\"pbf\">Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'C', 1676340592, 1676340646),
