(1242, 30, 27, 1, '', '', '<p>19. Nada sedang menjumlahkan nomor-nomor pada halaman buku miliknya mulai dari halaman 100 sampai halaman 200. Jika jumlah nomor halaman yang didapatkan Nada 15.300, pernyataan yang tepat adalah … </p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Halaman 150 terlewat oleh Nada sehingga tidak masuk dalam perhitungan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Nada menghitung halaman 150 sebanyak dua kali.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Halaman 150 terlewat oleh Nada sehingga tidak masuk dalam perhitungan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Hasil perhitungan Nada sudah tepat dan tidak ada kesalahan.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Nada menghitung halaman 100 dan 50 sebanyak dua kali.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676340868, 1676340868),
(1243, 30, 27, 1, '', '', '<p>19. Perhatikan teks berikut untuk menjawab soal no 19-20!</p><p><br></p><p><br></p><p>    Penghasilan pasif adalah penghasilan yang berasal dari properti sewaan, kemitraan terbatas, atau perusahaan lain di mana seseorang tidak terlibat secara aktif. Seperti halnya pendapatan aktif, penghasilan pasif biasanya dikenakan pajak, tetapi sering diperlakukan berbeda oleh Internal Revenue Service (IRS). Hal tersebut menjadi pendorong gaya hidup yang lebih mudah dan profesional karena dapat dikerjakan dari rumah dan dikelola sendiri. Penghasilan pasif telah menjadi istilah yang sudah biasa digunakan dalam beberapa tahun terakhir untuk mendefinisikan uang yang diperoleh secara teratur dengan sedikit atau tanpa usaha dari orang yang menerima.</p><p><br></p><p>    Jenis-jenis penghasilan pasif antara lain pendapatan bunga, properti sewaan, dan bisnis yang tidak melibatkan secara material. Pertama pendapatan bunga, yang dimaksud pendapatan bunga adalah ketika uang dipinjamkan ke kemitraan atau perusahaan, bunga atas pinjaman tersebut dikatakan sebagai pendapatan pasif. Kedua Pendapatan penyewaan properti. Pendapatan dari penyewaan properti adalah pendapatan yang diterima dari pihak lain atas sewa properti. Ketiga bisnis yang tidak melibatkan secara material. Jenis penghasilan pasif ini adalah jenis penghasilan yang terjadi karena adanya perjanjian antara pemilik usaha dengan orang yang berinvestasi (investor). Investor tidak berpartisipasi dalam operasi bisnis selain memasukkan dana ke perusahaan.</p><p>Pernyataan manakah yang termasuk ke dalam jenis penghasilan pasif?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Pendapatan bunga dari dana yang dipinjamkan ke perusahaan lain</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Bonus yang diterima karyawan saat mengerjakan projek tambahan</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Penghasilan yang diterima dari usaha sendiri</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Penghasilan gaji karyawan yang diterima setiap bulan</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Upah tenaga kerja yang dihitung berdasarkan jam kerja</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676341026, 1676341026),
