(1262, 30, 27, 1, '', '', '<p>Dalam acara reuni kampus informatika diadakan acara ramah tamah. Acara sambutan ketua panitia dilaksanakan sebelum doa. Pertunjukan Band mengambil alokasi waktu paling banyak. Ketua panitia harus meninggalkan acara sebelum band dimulai. Sedangkan acara penghargaan guru besar diselenggarakan agar undangan tidak meninggalkan ruangan sebelum band selesai. Doa dibacakan setelah ramah tamah. Susunan acara reuni kampus</p><p><br></p><p>informatika berdasarkan uraian diatas adalah ......</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>tidak ada pilihan jawaban yang benar</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>penghargaan - sambutan - band - doa - ramah tamah</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>sambutan - doa - penghargaan - band - ramah tamah</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>sambutan - penghargaan - band - ramah tamah- doa</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>penghargaan - band - doa - sambutan - ramah tamah.</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676347022, 1676347022),
(1263, 30, 27, 1, '', '', '<p>Seorang presenter acara hiburan harus membaca surat yang dikirim pada para pemirsa. Surat A dibaca menjelang akhir acara. Surat B dibaca lebih dahulu dari surat A tetapi bukan sebagai surat pembuka. Surat C dan D dibacakan berurutan diantara surat E dan B. Surat siapakah yang dibaca paling awal ?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>surat A</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>c surat C</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>surat B</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Surat E</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Surat D</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'D', 1676347128, 1676347128),
(1264, 30, 27, 1, '', '', '<p>Farhan menyenangi buku-buku fiksi, Meta penggemar komik dan ensiklopedia. Mayang membeli segala macam novel dan beberapa kamus. Irvan penggemar biografi. Sedang Sonya menyukai buku-buku non fiksi. Jika dibuat kelompok pembaca beranggotakan 3 orang, susunan anggota yang paling sesuai adalah .....</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Farhan-Meta-Irfan</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Irfan-Meta-Mayang</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Mayang-Sonya-Irfan</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Meta-Irfan-Sonya</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Farhan-Sonya-Mayang</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'A', 1676347256, 1676347256),
(1265, 30, 27, 1, '', '', '<p>Jarak antara kamus A dan B adalah dua kali jarak kampus C dan D. Kampus E terletak ditengah- tengah antara kampus C dan D. selanjutnya diketahui bahwa jarak kampus C ke kampus A sama dengan jarak kampus D ke B, yaitu setengah dari jarak kampus A ke kampus E. Kampus yang jaraknya paling jauh adalah ?</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>kampus A</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>kampus D</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>kampus B</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>kampus E</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '<p>Kampus C</p><p data-f-id=\"pbf\" xss=removed>Powered by <a href=\"https://www.froala.com/wysiwyg-editor?pb=1\" title=\"Froala Editor\">Froala Editor</a></p>', '', '', '', '', '', 'B', 1676347405, 1676347405),
