(541, 12, 5, 4, '', '', 'Tersaji pernyataan sebagai berikut.   1. Bukalah jendela Windows Explorer, dengan cara klik kanan pada Start menu Button Windows. Atau cara lain membuka Windows Explorer bias dilakukan dengan menekan tombol Windows pada keyboard Bersama dengan tombol huruf E.\n2. Klik kanan mouse, pilih Open Windows Explorer.\n3. Blok dengan cara meng-klik data yang akan dipindah, kemudian klik kanan mouse hingga muncul menu pilihan.\n4. Ketika sudah berada pada jendela Windows Explorer, pilih data yang akan dipindahkan ke dalam USB Flashdisk.\n5. Arahkan pada Sent to, kemudian klik Removable Disk.\n6. Jika data berukuran besar, akan membuhkan waktu beberaoa detik atau menit tergantung kecepatan computer anda.\n7. Tunggu hingga proses selesai, lakukan safety remove pada flashdisk jika akan mencabut atau melepas flasdisk dari computer atau laptop.\nUntuk memindah atau mencadangkan data dari computer ke dalam flashdisk, anda dapat melakukan caranya berurutan sebagai berikut?\n', '1-2-3-4-5-6-7', '1-2-4-3-6-5-7', '1-4-3-2-5-6-7', '1-2-4-3-5-6-7', '1-3-4-2-5-6-7', '', '', '', '', '', 'D', 0, 0),
