(593, 15, 7, 4, 'ea22acae6115d566047eacc46c5648c5.png', 'image/png', '<p>Logika : Berdasarkan diagram logika di atas, penamaan yang benar adalah ?.</p>', '<p>X = (A or B) xor C</p>', '<p>X = not(A and b) nor C</p>', '<p>X = not(C) nor (A and B)</p>', '<p>X = not(C) nor (A and B)</p>', '<p>X = not(C) xor (A or B)</p>', '', '', '', '', '', 'C', 0, 1586562100),
(600, 15, 7, 4, '', '', 'Perhatikan array berikut :  \'<?php\n  $bulan = array{\n    ?1? => ?Januari?,\n    ?2? => ?Februari?,\n    ?3? => ?Maret?,\n    ?4? => ?April?,\n    ?5? => ?Mei?,\n    ?6? => ?Juni?,\n    ?7? => ?Juli?,\n    ?8? => ?Agustus?,\n    ?9? => ?September?,\n    ?10? => ?Oktober?,\n    ?11? => ?Nopember?,\n    ?12? => ?Desember?\n  }\n?>\n Sintak di atas merupakan gambaran dari penggunaan array dalam bentuk ?.', '2 Dimensi', ' Multi Dimensi', 'Asosiatif', 'Komulatif', ' Substitusi', '', '', '', '', '', 'C', 0, 0),
(601, 15, 7, 4, '', '', 'Suatu tabel di dalam database paling tidak harus memiliki satu kolom yang di-set sebagai Primary Key. Programmer biasanya membuat penomoran otomatis yang bersifat Increment untuk menghindari duplikasi data. Hal ini dikarenakan ?.', 'Field dengan atribut Primary key bersifat Not Null', ' Field dengan atribut Primary key bersifat Unique', ' Field dengan atribut Primary key memiliki tipe data Integer / Int', ' Field dengan atribut Primary key memiliki tipe data Varchar / Char', 'Field dengan atribut Primary key berperan sebagai Index', '', '', '', '', '', 'B', 0, 0),
(602, 15, 7, 4, '', '', 'Dalam perancangan Relasi antar tabel, kolom yang berperan sebagai kunci tamu (Foreign Key) sebaiknya mengikuti perubahan yang terjadi pada tabel utama. Salah satu atribut yang dapat diterapkan agar tabel tamu ikut terbaharui apabila ada terjadi pembaharuan data pada tabel utama dalah ?.', 'UPDATE FROM FOREIGN KEY', 'ON FOREIGN.ID = PRIMARY.ID', 'DELETE FROM FOREIGN KEY', 'ON UPDATE CASCADE', 'ON DELETE CASCADE', '', '', '', '', '', 'D', 0, 0),
