(609, 15, 7, 4, '', '', ' Sebelum era smartphone dengan aplikasi mobile-nya, trend aplikasi terutama social media kebanyakan bahkan hampir keseluruhan berupa aplikasi web yang diakses melalui web browser. Dari segi teknis, faktor yang menyebabkan aplikasi web lebih mudah dikenal adalah ?.', ' Aplikasi berbasis web relatif mudah dibuat sehingga banyak developer yang tertarik', 'Aplikasi web tidak memerlukan IDE yang kompleks seperti aplikasi desktop', ' Aplikasi web berjalan di atas browser dan dapat diakses melalui jaringan publik', 'Aplikasi web bisa menampung banyak konten', 'Aplikasi web tidak memerlukan media khusus', '', '', '', '', '', 'C', 0, 0),
(610, 15, 7, 4, '', '', 'Dalam perancangan sebuah sistem, terdapat pembagian hak akses menjadi beberapa level atau tingkatan. Pembuat software biasanya menentukan tingkatan seperti Administrator, Operator dan Pengguna. Hal ini bertujuan untuk ?.', 'Pengelompokan pengguna; sehingga setiap pengguna tergabung menjadi group-group tertentu', 'Pembagian tugas; Setiap tingkatan memiliki tugas masing-masing', ' Itegritas data; setiap tingkatan memiliki hak dan wewenang tertentu di dalam sistem', 'Variasi pengguna; agar setiap level yang login mendapatkan perlakuan khusus seperti ucapan ?Selamat datang, Administrator?', 'Pengisian data; untuk menambah jumlah record pada tabel di database', '', '', '', '', '', 'C', 0, 0),
