(890, 19, 12, 4, '', '', 'Langkah-langkah untuk mengedit Account ..', 'Klik Tombol account pada jendela \"Command Centre\", Tampilkan jendela \"List Of Account\" atau klik panah Zoom Putih pada sisi kiri akun yang akan dirubah, lalu klik edit pada menu bar di lanjutkan dengan \"delete account\"', 'Klik Tombol account pada jendela \"Command Centre\", Tampilkan jendela \"List Of Account\" atau klik panah Zoom Putih pada sisi kiri akun yang akan dirubah, lalu lakukan perubahan informasi pada akun tersebut dengan cara klik tombol \"close\" setelah selesai melakukan perubahan informasi account', 'Klik setup pada menu bar dilanjutkan balance account opening balance, isikan saldo awal account pada field opening balance, lakukan sampai semua rekening terisi dengan saldo awal lalu klik OK', 'Klik Tombol account pada jendela \"Command Centre\", atau klik List pada menu bar, dilanjutkan dengan account, klik new pada account list', ' Klik List pada menu bar pilih menu Tax Code kemudian ubah akun GST menjadi PPN', '', '', '', '', '', 'A', 0, 0),
(891, 19, 12, 4, '', '', 'Bagaimana Cara menginstal myob Accounting v19', ' Cari file program Myob yang sudah di download, klik dua kali, pilih yes tunggu extracting krmudian klik next, pilih accept kemudian klik next dan ikuti langkah selanjutnya sampai mengklik finish', ' Mulai dari klik start kemudian all program pilih dan klik myob accounting dan klik myob accounting v19 maka muncul kotak dialog lalu klik yes', ' Klik open, klik drive, klik file dan user ID', '  Klik file dan User ID', '  Masuk ke drive C kemudian pilih program file cari MYOB kemudian buka', '', '', '', '', '', 'A', 0, 0),
(892, 19, 12, 4, '', '', 'Apa yang dimaksud dengan inventory ...', 'Kegiatan utama untuk mencatat daftar barang dagangan (item list), persediaan barang dagangan (Count Inventory), melihat harga pokok barang dan harga jual barang (set item prices) dan mengimput persediaan', 'Kegiatan untuk mencatat semua transaksi penjualan', 'Kegiatan untuk mencatat semua transaksi penerimaan', 'Kegiatan untuk mencatat semua transaksi pengeluran', ' Menu untuk menginput data mengenai supplier dan customer', '', '', '', '', '', 'A', 0, 0),
