(902, 13, 4, 4, '', '', 'Hal yang perlu diperhatikan dalam berpenampilan seorang sekretaris, adalah sebagai berikut :', 'Berdandan fully make up, tata rambut terikat rapi, menggunakan pakaian bersih dan rapi, tidak bermalas-malasan berbicara dengan tamu.', 'Berdandan sesuai waktu dan posisi dimana kita berada, tata rambut terikat rapi, menggunakan pakaian mencolok, tidak bermalas-malasan berbicara dengan tamu.', 'Berdandan sesuai waktu dan posisi dimana kita berada, tata rambut terikat rapi, menggunakan pakaian bersih dan rapi, berbicara seperlunya saja.', 'Berdandan sesuai waktu dan posisi dimana kita berada, tata rambut terikat rapi, menggunakan pakaian bersih dan rapi, tidak bermalas-malasan berbicara dengan tamu.', '', '', '', '', '', '', 'D', 0, 0),
(903, 13, 4, 4, '', '', 'Ciri ? ciri sekretaris yang ideal adalah', 'Memahami wewenang dan tangungjawab, pandai menjaga rahasia perusahaan, memiliki etika yang baik, pandai berbicara didepan publik, mampu menjaga kondisi fisik dan psikis dengan baik.', 'Tidak bertanggungjawab terhadap atasan, pandai menjaga rahasia perusahaan, memiliki etika yang baik, pandai berbicara didepan publik, mampu menjaga kondisi fisik dan psikis dengan baik', 'Memahami wewenang dan tangungjawab, pandai menjaga rahasia perusahaan, memiliki etika yang baik, tidak menguasai bahasa inggris dengan baik, mampu menjaga kondisi fisik dan psikis dengan baik', 'Memahami wewenang dan tangungjawab, pandai menjaga rahasia perusahaan, memiliki etika yang baik, tidak dapat mengatur intonasi suara, mampu menjaga kondisi fisik dan psikis dengan baik', '', '', '', '', '', '', 'B', 0, 0),
(904, 13, 4, 4, '', '', 'Dalam dunia sekretaris sering terdapat istilah grooming yang artinya', 'Pengembangan kepribadian', 'Penampilan diri', 'Etika komunikasi', 'Tata cara pergaulan', '', '', '', '', '', '', 'B', 0, 0),
(905, 13, 4, 4, '', '', 'Menurut sifatnya, Surat dibagi menjadi tiga jenis. Yaitu :', 'Surat biasa, surat edaran, surat pengumuman', 'Surat biasa, surat rahasia, surat sangat rahasia', 'Surat pribadi, surat resmi, surat niaga', 'Surat internal, surat eksternal', '', '', '', '', '', '', 'B', 0, 0),
(906, 13, 4, 4, '', '', 'Fungsi surat resmi adalah', 'Sebagai dokumen tertulis dan bukti hitam di atas putih. Sebagai alat pengingat, karena surat itu dapat diarsipkan sehingga mudah dicari apabila di perlukan. Sebagai bukti sejarah, seperti pada surat-surat tentang perubahan perkembangan suatu instansi. Sebagai pedoman kerja, seperti surat keputusan dan surat instruksi', 'Menggunakan instrument yang sesuai termasuk ukuran kertas, jenis & warna, tinta, serta bentuk tulisan; Memakai bentuk surat yang standar; Menggunakan bahasa Indonesia yang baku dengan penyampaian singkat, lugas, jelas dan santun, serta menyajikan fakta yyang benar jika diperlukan; Menghindari kata-kata singkatan dan tidak umum, perhatikan kerapihan dan kebersihan', 'Hanya sebagai surat edaran', 'Sebagai surat himbauan untuk golongan tertentu', '', '', '', '', '', '', 'A', 0, 0),
(907, 13, 4, 4, '', '', 'Berikut adalah jenis jenis surat niaga, kecuali :', 'Akta jual beli', 'Kuitansi', 'Surat Tanah dan bangunan', 'Surat tagihan', '', '', '', '', '', '', 'B', 0, 0),
(908, 13, 4, 4, '', '', 'Peraturan yang dibuat oleh perusahaan terkait dalam bidang kearsipan biasanya dibuat dalam bentuk', 'Etika', 'Kaidah', 'Prosedur', 'Norma', '', '', '', '', '', '', 'C', 0, 0),
(909, 13, 4, 4, '', '', 'Saat mencari arsip dilemari arsip, anda membutuhkan waktu yang lama untuk mencarinya atau justru arsip tersebut tidak diketemukan. Berikut yang tidka termasuk simpulan yang dapat diambil dari contoh kasus tersebut adalah', 'Penyimpanan arsip tidak menggunakan sistem tertentu', 'Peminjaman arsip sesuai dengan prosedur', 'Arsip hilang', 'Arsip tidak ditata', '', '', '', '', '', '', 'A', 0, 0),
